  StandaloneDataFetcher.prototype._mangleRuns = function() {
    var i, j, run, metricCfgs, metrics, hideSingleTopLevel = false;

    function usesSimpleInheritance(name) {
      var metric, enabled, no_children, tcl;
      if (metricCfgs) {
        metric = CDNMetricComparison.matchMetricConfig(name, metricCfgs).config;
      }
      if (! metric) {
        return true;
      } else {
        enabled = metric.inheritance_enabled;
        if (enabled === undefined) {enabled = true;}
        no_children = metric.inherit_no_children;
        if (no_children === undefined) {no_children = false;}
        tcl = metric.inheritance_tcl;
        if (tcl === undefined) {tcl = '';}
        return enabled && ! no_children && tcl.length === 0;
      }
    }

    function stripSnapshotLevel(snapshots) {
      var i;
      if (! snapshots) {
        return;
      }
      for (i = 0; i < snapshots.length; i++) {
        snapshots[i].path = snapshots[i].path.split('/').slice(1).join('/');
        stripSnapshotLevel(snapshots[i].snapshots);
      }
    }

    function mangleSnapshot(runId, parentMetrics, snapshot) {
      var metrics, i, name, clone;
      if (snapshot.metrics instanceof Array) {
        metrics = {};
        snapshot.metrics.forEach(function(metric) {
          metrics[metric.name] = metric;
        });
        snapshot.metrics = metrics;
      }

      if (snapshot.snapshots) {
        for (i = snapshot.snapshots.length - 1; i >= 0; i--) {
          mangleSnapshot(runId, snapshot.metrics, snapshot.snapshots[i]);
        }
      } else {
        snapshot.snapshots = [];
      }
      snapshot.run_id = runId;

      for (name in snapshot.metrics) {
        if (parentMetrics[name] === undefined && usesSimpleInheritance(name)) {
          clone = CDNHelpers.shallowClone(snapshot.metrics[name]);
          clone.inherited = true;
          parentMetrics[name] = clone;
        }
      }
    }

    for (i = 0; i < window.runs.length; i++) {
      run = window.runs[i];

      // Run/Testsuite looks like a snapshot
      run.path = '';
      run.run_id = '' + i;
      run.name = run.run_id;

      if (run.metric_cfgs instanceof Array) {
        metricCfgs = {};
        run.metric_cfgs.map(function(metricCfg) {
          metricCfgs[metricCfg.metric] = metricCfg;
          delete metricCfg.metric;
        });
        run.metric_cfgs = metricCfgs;
      }

      if (run.metrics instanceof Array) {
        metrics = {};
        run.metrics.forEach(function(metric) {
          metrics[metric.name] = metric;
        });
        run.metrics = metrics;
      }

      for (j = run.snapshots.length - 1; j >= 0; j--) {
        mangleSnapshot('' + i, run.metrics, run.snapshots[j]);
      }
      if (hideSingleTopLevel && run.snapshots.length === 1 && run.snapshots[0].snapshots && run.snapshots[0].snapshots.length > 0) {
        // Single top-level snapshot, cut it out of the hierarchy (assume it is
        // a single top-level flow snapshot e.g. block)
        run.metrics = run.snapshots[0].metrics;
        run.snapshots = run.snapshots[0].snapshots;
        stripSnapshotLevel(run.snapshots);
      }

      this.runs.push(run);
    }
  };

  StandaloneDataFetcher.prototype.getSnapshotByPath = function(runId, path, callback) {
    // TODO: Add a top-level testsuite and match the path "run" for the run
    this.getRun(runId, function(runData) {
      var components, component, thing, i, j, found, partialPath;

      components = path.split('/');

      thing = runData;

      for (i = 0; i < components.length; i++) {
        if (! components[i]) {
          continue;
        }
        found = false;
        partialPath = components.slice(0, i + 1).filter(function(x){return !!x;}).join('/');
        for (j = 0; j < thing.snapshots.length; j++) {
          if (thing.snapshots[j].path === partialPath) {
            found = true;
            thing = thing.snapshots[j];
            break;
          }
        }
        if (! found) {
          thing = undefined;
          break;
        }
      }

      callback(thing);
    });
  };

  StandaloneDataFetcher.prototype.getSimpleMetadataValue = function(callback, runId, type, uid) {

    for (i = 0; i < this.runs.length; i++) {
      if (runId === this.runs[i].run_id) {
        if (this.runs[i].metadata && this.runs[i].metadata[type] && this.runs[i].metadata[type][uid]) {
          value = this.runs[i].metadata[type][uid].value;
          switch (type) {
            case 'timing_data':
              // AUM knows to provide this as JSON data without help
              value = JSON.parse(value);
              break;
            default:
              break;
          }
          callback(value);
          return;
        }
        break;
      }
    }
    callback(undefined);
  };



  function CDNDataManager() {
    this.comparisonRuns = [];
    this.comparisonTestsuites = [];
    this.comparisonMethod = CDNDataManager.COMPARE_TESTSUITES;

    this.historyDates = '';
    this.previousFilter = '';
    this.apiRoot = undefined;
  }

  CDNDataManager.COMPARE_RUNS = CDNDataManager.prototype.COMPARE_RUNS = 'runs';
  CDNDataManager.COMPARE_TESTSUITES = CDNDataManager.prototype.COMPARE_TESTSUITES = 'testsuites';
  CDNDataManager.COMPARE_HISTORY = CDNDataManager.prototype.COMPARE_HISTORY = 'history'; // Not strictly comparison but a change in navigation for testsuites

  CDNDataManager.prototype.begin = function(apiRoot) {
    this.apiRoot = apiRoot;
    if (cdnPage.getMode() === cdnPage.MODE_AUM) {
      this.fetcher = new RestDataFetcher(apiRoot);
    } else {
      this.fetcher = new StandaloneDataFetcher();
      this.comparisonMethod = CDNDataManager.COMPARE_RUNS;
    }
  };

  CDNDataManager.prototype.getComparisonMethod = function() {
    return this.comparisonMethod;
  };

  CDNDataManager.prototype.getApiRoot = function() {
    return this.apiRoot;

  CDNDataManager.prototype.applyHashDefaults = function(hashed) {
    var defaults, key, neededUpdate, newHash, runs, hashedRuns;

    // Don't default run or testsuite to an empty array as they are removed at
    // hash construction time anyway
    defaults = {};

    newHash = {};

    neededUpdate = false;
    for (key in defaults) {
      if (hashed[key] === undefined) {
        newHash[key] = defaults[key];
        neededUpdate = true;
      } else {
        newHash[key] = hashed[key];
      }
    }

    if (cdnPage.getMode() === cdnPage.MODE_SUM) {
      if (hashed.run instanceof Array) {
        hashedRuns = hashed.run;
      } else if (hashed.run !== undefined) {
        hashedRuns = [hashed.run];
      } else {
        hashedRuns = [];
      }
      runs = this.fetcher.getRunIds();
      if (! CDNHelpers.shallowEqual(hashedRuns, runs)) {
        newHash.run = runs;
        neededUpdate = true;
      }
      if (hashed.testsuite) {
        newHash.testsuite = null;
        neededUpdate = true;
      }
      if (hashed.history) {
        newHash.history = null;
        neededUpdate = true;
      }
    }

    if (neededUpdate) {
      // Only update the values we understand (have defaults for)
      cdnPage.updateHash(newHash);
    }

    return neededUpdate;
  };

  CDNDataManager.prototype.hashchange = function(hashed, preventUpdate) {
    var updated, comparisonPath, comparisonDesign, historyDates, comparisonRuns, comparisonTestsuites, updatedMethod;

    // Use local cached copies of the variables so we can not apply them if we
    // going to get another hashchange event due to a partialHash
    comparisonPath = this.comparisonPath;
    comparisonDesign = this.comparisonDesign;
    comparisonRuns = this.comparisonRuns;
    historyDates = this.historyDates;
    comparisonTestsuites = this.comparisonTestsuites;

    if (this.applyHashDefaults(hashed)) {
      // If defaults were applied, the hash was updated (which will call this
      // function again so return immediately)
      return;
    }

    comparisonPath = hashed.path || '';

    comparisonDesign = hashed.run_header;
    historyDates = hashed.history_span;

    if (hashed.run instanceof Array) {
      comparisonRuns = hashed.run;
    } else if (hashed.run !== undefined) {
      comparisonRuns = [hashed.run];
    } else {
      comparisonRuns = [];
    }

    if (hashed.testsuite instanceof Array) {
      comparisonTestsuites = hashed.testsuite;
    } else if (hashed.testsuite !== undefined) {
      comparisonTestsuites = [hashed.testsuite];
    } else {
      comparisonTestsuites = [];
    }

    updated = false;
    if (this.comparisonPath !== comparisonPath) {
      updated = true;
      this.comparisonPath = comparisonPath;
    }
    if (this.comparisonDesign !== comparisonDesign) {
      updated = true;
      this.comparisonDesign = comparisonDesign;
    }
    if (this.historyDates !== historyDates) {
      updated = true;
      this.historyDates = historyDates;
    }
    if (! CDNHelpers.shallowEqual(this.comparisonRuns, comparisonRuns)) {
      updated = true;
      this.comparisonRuns = comparisonRuns;
    }
    if (! CDNHelpers.shallowEqual(this.comparisonTestsuites, comparisonTestsuites)) {
      updated = true;
      this.comparisonTestsuites = comparisonTestsuites;
    }

    updatedMethod = false;
    if (this.comparisonRuns.length > 0 &&
        this.comparisonMethod !== CDNDataManager.COMPARE_RUNS) {
      updated = true;
      updatedMethod = true;
      this.comparisonMethod = CDNDataManager.COMPARE_RUNS;
    } else if (this.comparisonRuns.length === 0 && hashed.history &&
        this.comparisonMethod !== CDNDataManager.COMPARE_HISTORY) {
      updated = true;
      updatedMethod = true;
      this.comparisonMethod = CDNDataManager.COMPARE_HISTORY;
    } else if (this.comparisonRuns.length === 0 && !hashed.history &&
        this.comparisonMethod !== CDNDataManager.COMPARE_TESTSUITES) {
      updated = true;
      updatedMethod = true;
      this.comparisonMethod = CDNDataManager.COMPARE_TESTSUITES;
    }

    if (updated && !preventUpdate) {
      console.log('hashChange - CDNDataManager notify event');
      this._notifyNewData();
    }
    if (updatedMethod) {
      this._notifyNewDefaultConfig();
    }
  };

  CDNDataManager.prototype.reportComparison = function() {
    if (this.comparisonMethod === CDNDataManager.COMPARE_TESTSUITES && this.comparisonTestsuites.length > 1) {
      this.fetcher.reportComparison(this.comparisonTestsuites);
    }
  };

      this.getRunHeaders(function(headers) {
        var header, i;
        switch (this.comparisonMethod) {
        case CDNDataManager.COMPARE_RUNS:
          // Duplicated in cachedUrlForSubPath
          header = 'default_view_run';
          break;
        case CDNDataManager.COMPARE_TESTSUITES:
          header = 'default_view_testsuite';
          break;
        case CDNDataManager.COMPARE_HISTORY:
          header = 'default_view_history';
          break;
        }
        for (i = headers.length - 1; i >= 0; i--) {
          if (headers[i][header]) {
            callback(headers[i][header]);

        callback(undefined);

    switch (comparisonMethod) {

    case CDNDataManager.COMPARE_TESTSUITES:
      if (hash.testsuite && hash.testsuite.length > 0) {

      } else {

      break;

              this.updateViewSelection();

          this.activeConfigName = defaultValue;

  CDNPage.prototype.hashStrFromObj = function(hashed) {

  };

        var args;
        args = shape.slice();
        args.unshift(CDNColor.get(layerNum), false);

          }
          // Add metrics
          for (i = 0; i < this.config.ar_metric.length; i++) {
            rowConfig = CDNHelpers.shallowClone(this.config.ar_metric[i]);
            if (rowConfig.metric) {
              for (j = 0; j < replacements.length; j++) {
                if (replacements[j] === null) {
                  rowConfig.metric = removeFirstReplacement(rowConfig.metric);
                } else {
                  rowConfig.metric = rowConfig.metric.replace(/%/, replacements[j]);
                }
              }
            }
            for (property in rowConfig) {
              if (rowConfig[property] === '' + rowConfig[property] && property.substr(0, 4) === 'link') {
                for (j = 0; j < replacements.length; j++) {
                  if (replacements[j] === null) {
                    rowConfig[property] = removeFirstReplacement(rowConfig[property]);
                  } else {
                    rowConfig[property] = rowConfig[property].replace(/%/, replacements[j]);
                  }
                }
              }
            }
            // TODO This will be complicated by group graph columns
            colIndex = this.prototypeDescriptions[0].length - (this.config.ar_metric.length - i);
            row.push({
              type: 'metricValue',
              comparison: this._metricComparison(rowConfig),
              config: rowConfig,
              groupCount: this.prototypeDescriptions[0][colIndex].groupCount,
              groupStart: this.prototypeDescriptions[0][colIndex].groupStart
            });
          }
          // Increment position through keys
          for (i = position.length - 1; i >= 0; i--) {
            position[i]++;
            if (position[i] < this.config.key[i].metrics.length) {
              break;
            }
            if (collapsible_key) {
              position[i] = -1;
            } else {
              position[i] = 0;
            }
          }
          if (collapsible_key) {

            }

            comparison: comparison,
            config: this.config.ar_metric[i],

  };
  CDNTable.prototype.draw = function() {
    var i, j, desc, row, cells, k, offset, comparisonCount, link, img;

    comparisonCount = cdnDataManager.getComparisonCount();

    CDNHelpers.removeChildren(this.table);
    nextRow: for (i = 0; i < this.descriptions.length; i++) {
      row = document.createElement('tr');
      if (! this.presentations[i]) {
        this.presentations[i] = [];
      }
      for (j = 0; j < this.descriptions[i].length; j++) {
        desc = this.descriptions[i][j];
        if (this.presentations[i][j]) {
          this.presentations[i][j].finalize();
          delete this.presentations[i][j];
        }
        if (! desc) {
          continue
        }
        cells = undefined;
        switch (desc.type) {
          case 'hierarchical_heading':
            this.presentations[i][j] = new CDNHierarchicalHeader(desc.comparison, this.config.hierarchical_separator, desc.replacements[0]);
            cells = desc.comparison.getCells(undefined, 'th');
            this.presentations[i][j].applyCells(cells);
            /* FALLTHROUGH on purpose */
          case 'collapse':
            if (! cells) {
              cells = [document.createElement('th')];
              if (desc.firstCollapse) {
                link = document.createElement('a');
                link.href = '#never-visited-url';
                link.addEventListener('click', function(desc, event) {
                  event.preventDefault();
                  if (this.expandedKeys[desc.subPath] && this.expandedKeys[desc.subPath][desc.keyIndex]) {

                if (this.expandedKeys[desc.subPath] && this.expandedKeys[desc.subPath][desc.keyIndex]) {

                } else {

            if (desc.footerStart) {

              } else {

                  cells[0].colSpan = 4;
                  cells[0].setAttribute('data-header-vertical', 'end');

                  cells[0].setAttribute('data-header-horizontal', 'end');

              }

                cells[0].setAttribute('data-header-vertical', 'end');
              }
            } else {
              if (desc.rowHeadingsEnd) {
                if (this.config.flip_axis) {
                  cells[0].setAttribute('data-header-horizontal', 'end');
                } else {
                  cells[0].setAttribute('data-header-vertical', 'end');
                }
              }
              if (desc.headerHorizontalEnd) {
                cells[0].setAttribute('data-header-horizontal', 'end');
              }
              if (desc.headerVerticalEnd) {
                cells[0].setAttribute('data-header-vertical', 'end');
              }
              if (desc.collapseSpan) {
                if (this.config.flip_axis) {
                  cells[0].colSpan = (cells[0].colSpan || (2 * comparisonCount)) * desc.collapseSpan;
                } else {
                  cells[0].rowSpan = desc.collapseSpan;
                }
              } else if (desc.span) {
                if (this.config.flip_axis) {
                  cells[0].colSpan = (cells[0].colSpan || (2 * comparisonCount)) * desc.span;
                } else {

                }
              }
            }
            row.appendChild(cells[0]);
            break;
          case 'metricHeader':
            this.presentations[i][j] = new CDNMetricCfgHeader(desc.comparison, desc.config);
            cells = this.presentations[i][j].getCells(row, desc.groupCount, this.config.flip_axis ? undefined : i);
            if (desc.groupStart) {

            if (cells[cells.length - 1]) {

              if (cell) {
                if (desc.groupStart && this.config.flip_axis) {
                  cell.setAttribute('data-group-start', 'vertical');
                } else {
                  cell.removeAttribute('data-group-start');
                }
                if (desc.footerStart && ! this.config.flip_axis) {
                  cell.setAttribute('data-footer-start', 'horizontal');
                } else {
                  cell.removeAttribute('data-footer-start');
                }
                if (desc.headerHorizontalEnd) {
                  cell.setAttribute('data-header-horizontal', 'end');
                } else {
                  cell.removeAttribute('data-header-horizontal');
                }
                if (desc.headerVerticalEnd) {
                  cell.setAttribute('data-header-vertical', 'end');
                } else {
                  cell.removeAttribute('data-header-vertical');
                }
              }
            }.bind(this));
            if (desc.groupStart && !this.config.flip_axis) {
              cells[0].setAttribute('data-group-start', 'horizontal');
            }
            if (desc.footerStart && this.config.flip_axis) {
              cells[0].setAttribute('data-footer-start', 'vertical');
            }
            if (desc.type === 'winsLosses') {
              this.presentations[i][j] = new CDNWinsLossesCell(desc.comparison, desc.columnComparisons, desc.groupPageConfigs, desc.groupRowComparisons, desc.groupAllComparisons);
              this.presentations[i][j].applyCells(cells, desc.config);
            } else if (desc.config && desc.config.renderer && window[desc.config.renderer]) {
              this.presentations[i][j] = new (window[desc.config.renderer])(desc.comparison, desc.columnComparisons, desc.groupPageConfigs, desc.groupRowComparisons, desc.groupAllComparisons);
              this.presentations[i][j].applyCells(cells, desc.config);
            } else {
              desc.comparison.getRenderer(function(i, j, cells, desc, Renderer) {
                this.presentations[i][j] = new Renderer(desc.comparison, desc.columnComparisons, desc.groupPageConfigs, desc.groupRowComparisons, desc.groupAllComparisons);

            }
            break;
          case 'snapshotHeading':
            cells = desc.comparison.getCells(undefined, 'th');
            this.presentations[i][j] = new CDNSnapshotHeader(desc.comparison, desc.subPath, desc.branch, this.config.navigation, this.config.historyNavigation, desc.secondarySubPath);
            this.presentations[i][j].applyCells(cells);

            // cell to show

            cells = cells.slice(offset, offset + (this.config.historyNavigation ? 2 : 1));
            cells.map(function(cell, i) {

                if (this.config.historyNavigation) {
                  cell.colSpan = comparisonCount * desc.span;
                } else {
                  cell.colSpan = 2 * comparisonCount * desc.span;
                }
              } else {
                if (this.config.historyNavigation) {
                  cell.colSpan = comparisonCount;
                } else {
                  cell.colSpan = 2 * comparisonCount;
                }
                if (desc.collapseSpan) {
                  cell.rowSpan = desc.collapseSpan;
                } else {
                  cell.rowSpan = desc.span;
                }
              }
              if (desc.rowHeadingsEnd && (! this.config.historyNavigation || i === 1)) {
                if (this.config.flip_axis) {
                  cell.setAttribute('data-header-horizontal', 'end');
                } else {
                  cell.setAttribute('data-header-vertical', 'end');
                }
              }
              row.appendChild(cell);
            }.bind(this));
            break;
          case 'graphLink':
            cells = [document.createElement('td')];
            cells[0].colSpan = 2 * comparisonCount;
            if (desc.groupStart) {
              cells[0].setAttribute('data-group-start', this.config.flip_axis ? 'vertical' : 'horizontal');
            }
            if (desc.footerStart) {
              cells[0].setAttribute('data-footer-start', this.config.flip_axis ? 'vertical' : 'horizontal');
            }
            if (desc.headerHorizontalEnd) {
              cells[0].setAttribute('data-header-horizontal', 'end');
            }
            if (desc.headerVerticalEnd) {
              cells[0].setAttribute('data-header-vertical', 'end');
            }
            cells[0].setAttribute('data-metric-compare', 'cdn-graph');
            link = document.createElement('a');
            link.href = '#never-visited-url';
            img = document.createElement('span');
            link.appendChild(img);
            cells[0].appendChild(link);
            switch (desc.config.graph_type) {
              case 'treemap':
                img.className = 'cdn-chart-treemap-button';
                img.alt = img.title = 'Show treemap graph';
                break;
              case 'none':
                cells[0].removeChild(link);
                row.appendChild(cells[0]);
                // Don't do anything further with the link, continue the for loop for the next cell
                continue;
              case 'line':
              default:
                img.className = 'cdn-chart-line-button';
                img.alt = img.title = 'Show line graph';
                break;
            }
            link.addEventListener('click', this._toggleGraphForMetric.bind(this, desc.index, undefined), false);
            this.graphLinks[desc.index] = cells[0];
            row.appendChild(cells[0]);
            break;
          default:
            console.warn('Unable to render internal CDNTable cell type: '+desc.type);
            break;
        }
      }
      for (j = this.presentations[i].length - 1; j >= this.descriptions[i].length; j--) {
        if (this.presentations[i][j]) {
          this.presentations[i][j].finalize();
        }
        this.presentations[i].pop();
      }
      this.table.appendChild(row);
    }
    for (i = this.presentations.length - 1; i >= this.descriptions.length; i--) {
      for (j = 0; j < this.presentations[i].length; j++) {
        if (this.presentations[i][j]) {
          this.presentations[i][j].finalize();
          delete this.presentations[i][j];
        }
      }
      this.presentations.pop();
    }
  };
  CDNTable.prototype.mangleDescriptions = function() {
    var i, j;
    this.descriptions = [];
    for (i = 0; i < this.prototypeDescriptions.length; i++) {
      for (j = 0; j < this.prototypeDescriptions[i].length; j++) {
        if (! this.descriptions[i]) {
          this.descriptions[i] = [];
        }
        this.descriptions[i][j] = CDNHelpers.shallowClone(this.prototypeDescriptions[i][j]);
      }
    }

    this.calculateCollapseSpans();
    this.flipDescriptions();
  };
  CDNTable.prototype.calculateCollapseSpans = function() {
    var i, j, desc, offset;
    if (! this.config.collapsible_key || this.config.hierarchical_separator || this.config.flip_axis) {
      // Collapsible_key does not operate with hierarchical_separator renderer
      // or vertical tables (to make removing/hiding rows/columns simpler)
      return;
    }
    offset = 0;
    if (this.config.per_snapshot) {
      offset = 1;
    }
    for (i = 1; i <= this.dataRows; i++) {
      if (this.config.per_snapshot) {
        desc = this.descriptions[i][0];
        if (desc) {
          if (CDNHelpers.isEmpty(this.expandedKeys[desc.subPath])) {
            desc.collapseSpan = 1;
          } else {
            desc.collapseSpan = this.config.key.reduce(function(previousValue, currentValue, index) {
              if (this.expandedKeys[desc.subPath][index]) {
                return previousValue * Math.max(currentValue.metrics.length + 1, 1);
              } else {
                return previousValue;
              }
            }.bind(this), 1);
          }
        }
      }
      for (j = offset; j < this.leftHeadingCount; j++) {
        desc = this.descriptions[i][j];
        if (! desc) {
          continue;
        }
        if (this.expandedKeys[desc.subPath] && this.expandedKeys[desc.subPath][desc.keyIndex]) {
          desc.collapseSpan = this.config.key.slice(desc.keyIndex + 1).reduce(function(previousValue, currentValue, index) {
            if (this.expandedKeys[desc.subPath] && this.expandedKeys[desc.subPath][desc.keyIndex + 1 + index]) {
              return previousValue * Math.max(currentValue.metrics.length + 1, 1);
            } else {
              return previousValue;
            }
          }.bind(this), 1);
          if (! desc.firstCollapse && desc.keyIndex > 0) {
            // Show when all keys to the left for the current row are either
            // firstCollapse (position -1) or are expanded
            desc.collapsed = desc.keyPosition.slice(0, desc.keyIndex).some(function(positionIndex, keyIndex) {
              return positionIndex >= 0 && ! (this.expandedKeys[desc.subPath] && this.expandedKeys[desc.subPath][keyIndex]);
            }.bind(this));
          }
        } else {
          if (desc.firstCollapse) {
            desc.collapseSpan = this.config.key.reduce(function(previousValue, currentValue, index) {
              if (index !== desc.keyIndex && this.expandedKeys[desc.subPath] && this.expandedKeys[desc.subPath][index]) {
                return previousValue * Math.max(currentValue.metrics.length + 1, 1);
              } else {
                return previousValue;
              }
            }.bind(this), 1);
          } else if (desc.anyCollapse) {
            // Show when all keys to the left for the current row are either
            // firstCollapse (position -1) or are expanded
            desc.collapsed = desc.keyPosition.slice(0, desc.keyIndex).some(function(positionIndex, keyIndex) {
              return positionIndex >= 0 && ! (this.expandedKeys[desc.subPath] && this.expandedKeys[desc.subPath][keyIndex]);
            }.bind(this));
          } else {
            desc.collapsed = true;
          }
        }
      }
    }
  };
  CDNTable.prototype.flipDescriptions = function() {
    var i, j, row, desc, comparison, descriptions;
    if (this.config.flip_axis) {
      this.headingSpan = this.prototypeHeadingSpan;
      descriptions = this.descriptions;
      this.descriptions = [];
      for (i = 0; i < descriptions.length; i++) {
        for (j = 0; j < descriptions[i].length; j++) {
          if (! this.descriptions[j]) {
            this.descriptions[j] = [];
          }
          this.descriptions[j][i] = descriptions[i][j];
        }
      }
      if (cdnDataManager.getComparisonCount() > 1) {
        this.headingSpan++;
        row = [];
        for (i = 0; this.descriptions[this.leftHeadingCount] && i < this.descriptions[this.leftHeadingCount].length; i++) {
          switch (this.descriptions[this.leftHeadingCount][i].type) {
          case 'winsLosses':
          case 'metricValue':
            row.push({
              type: 'metricValue',
              subType: 'th',
              comparison: new CDNMetricComparison('_comparison_label_'),
              config: undefined,
              headerHorizontalEnd: true,
              footerStart: (this.descriptions[0][i] ? this.descriptions[0][i].footerStart : false)
            });
            break;
          case 'metricHeader':
            row.push({
              type: 'th',
              title: 'Comparison',
              stretchedHeading: true,
              rowHeadingsEnd: true
            });
            break;
          default:
            row.push({
              type: 'th',
              title: 'Comparison',
              stretchedHeading: true,
              rowHeadingsEnd: true,
              summaryComparisonTitle: true,
              footerStart: this.descriptions[0][i].footerStart
            });
            break;
          }
        }
        this.descriptions.splice(this.leftHeadingCount, 0, row);
      }
    } else {
      this.headingSpan = 2;
      // Horizontal table headings take two rows, duplicate the first row (the
      // draw function knows how to render the two rows appropriately)
      this.descriptions.splice(1, 0, this.descriptions[0] || []);
      if (cdnDataManager.getComparisonCount() > 1) {
        this.headingSpan++;
        row = [];
        for (i = 0; i < this.descriptions[0].length; i++) {
          if (this.descriptions[0][i].type === 'metricHeader') {
            row.push({
              type: 'metricValue',
              subType: 'th',
              comparison: new CDNMetricComparison('_comparison_label_'),
              config: undefined,
              headerHorizontalEnd: true,
              groupCount: this.descriptions[0][i].groupCount,
              groupStart: this.descriptions[0][i].groupStart
            });
          } else {
            desc = {
              type: 'th',
              stretchedHeading: true
            };
            row.push(desc);
          }
        }
        this.descriptions.splice(2, 0, row);
      }
    }
  };
  CDNTable.prototype.calculateAutoHide = function() {
    var i, j, comparison, comparisons, table;

    if (! this.config.auto_hide) {
      return;
    }

    comparisons = [];
    for (i = 0; i < this.summaryComparisons.length; i++) {
      if (this.summaryComparisons[i]) {
        for (j = 0; j < this.summaryComparisons[i].length; j++) {
          if (this.summaryComparisons[i][j]) {
            comparisons.push(this.summaryComparisons[i][j]);
          }
        }
      }
    }

    table = this.table;
    comparison = new CDNMetricSummaryComparison(CDNMetricSummaryComparison.FIRST_DEFINED, comparisons);
    comparison.getValueDescriptions(function(descriptions) {
      var i, p;
      if (table !== this.table) {
        // Check for config updates
        return;
      }
      for (i = 0; i < descriptions.length; i++) {
        if (descriptions[i].defined) {
          return;
        }
      }
      p = document.createElement('p');
      p.className = 'cdn-table-auto-hide-warning';
      p.textContent = 'This table contains no data';
      if (this.table.parentNode) {
        this.table.parentNode.insertBefore(p, this.table);
        this.table.style.display = 'none';
      }
    }.bind(this));

  };
  CDNTable.prototype.populateGroupAndColumnSummaries = function() {
    var i, j, k, desc, comparisons, configs;

    // Column summary
    comparisons = [];
    for (i = 1; i <= this.dataRows; i++) {
      for (j = this.leftHeadingCount; j < this.prototypeDescriptions[i].length; j++) {
        desc = this.prototypeDescriptions[i][j];
        if (! comparisons[j]) {
          comparisons[j] = [];
        }
        comparisons[j].push(desc.comparison);
        desc.columnComparisons = comparisons[j];
      }
    }

    if (this.dataRows > 0) {
      // Group all summary
      for (j = this.leftHeadingCount; j < this.prototypeDescriptions[1].length; j++) {
        desc = this.prototypeDescriptions[1][j];
        if (desc.config.group && (j === this.leftHeadingCount || desc.config.group !== this.prototypeDescriptions[1][j - 1].config.group)) {
          comparisons = [];
          for (k = j; k < j + desc.groupCount; k++) {
            comparisons = comparisons.concat(this.prototypeDescriptions[1][k].columnComparisons);
          }
          for (k = j; k < j + desc.groupCount; k++) {
            for (i = 1; i <= this.dataRows; i++) {
              this.prototypeDescriptions[i][k].groupAllComparisons = comparisons;
            }
          }
          j = k - 1;
        } else {
          delete desc.groupAllComparisons;
        }
      }
    }

    // Group row summary
    for (i = 1; i <= this.dataRows; i++) {
      for (j = this.leftHeadingCount; j < this.prototypeDescriptions[i].length; j++) {
        desc = this.prototypeDescriptions[i][j];
        if (desc.config.group && (j === this.leftHeadingCount || desc.config.group !== this.prototypeDescriptions[i][j - 1].config.group)) {
          comparisons = [];
          configs = [];
          for (k = j; k < j + desc.groupCount; k++) {
            comparisons.push(this.prototypeDescriptions[i][k].comparison);
            this.prototypeDescriptions[i][k].groupRowComparisons = comparisons;
            configs.push(this.prototypeDescriptions[i][k].config);
            this.prototypeDescriptions[i][k].groupPageConfigs = configs;
          }
          j = k - 1;
        } else {
          delete desc.groupRowComparisons;
          delete desc.groupPageConfigs;
        }
      }
    }
  };



  /********************************
   * per snapshot behavior
   */

  CDNTable.prototype.receiveSnapshots = function(comparableSnapshots) {
    var i, j, k, length, path, subPaths, lastNestedSubPaths, nestedSubPaths, paths, snapNames, snapshots, snapshotPaths, lastPath, sequencer, nestedSequencer, branchByLastPath, previousBranch, branch, keyCount, row, position, replacements, rowConfig, colIndex, comparison, titles, property, collapsible_key, metricName;

      parts = CDNHelpers.splitUnescaped('.', name);
      replacement = /(?:^|[^\\])(?:\\\\)*%/;
      for (i = 0; i < parts.length; i++) {
        if (parts[i].match(replacement)) {
          parts.splice(i, 1);
          break;
        }
      }
      return parts.join('.');
    }

    this.subPathSnapshot = {};

    if (comparableSnapshots.length > 1 && !cdnPage.getServerPublicConfig()['show_gold_only_snapshots']) {
      // Don't include paths only in the gold snapshot
      length = comparableSnapshots.length - 1;
    } else {
      length = comparableSnapshots.length;
    }

    sequencer = new CDNHelpers.SequenceCombiner();
    nestedSequencer = new CDNHelpers.SequenceCombiner();
    subPaths = [];
    snapNames = {};
    lastNestedSubPaths = [];
    nestedSubPaths = [];
    branchByLastPath = {};

    for (i = 0; i < length; i++) {
      if (comparableSnapshots[i]) {
        snapshots = comparableSnapshots[i].snapshots;
        if (snapshots) {
          snapshotPaths = [];
          for (j = 0; j < snapshots.length; j++) {
            if (! snapshots[j]) {
              continue;
            }
            path = snapshots[j].path.split('/');
            lastPath = path[path.length - 1];
            snapNames[lastPath] = snapshots[j].name;
            snapshotPaths.push(lastPath);
            if (! branchByLastPath[lastPath]) {
              branchByLastPath[lastPath] = snapshots[j].branch;
            } else if (branchByLastPath[lastPath] !== snapshots[j].branch) {
              branchByLastPath[lastPath] = null;
            }

            // selection on the testsuite page
            if (snapshots[j].snapshots && snapshots[j].snapshots.length) {

                return snap.path;
              }).reduce(function(previous, path) {
                // Remove duplicates
                if (previous.indexOf(path) < 0) {
                  previous.push(path);
                }
                return previous;
              }, []);
              if (! lastNestedSubPaths[j]) {
                lastNestedSubPaths[j] = paths[paths.length - 1];
              }
              nestedSubPaths = nestedSequencer.mergeWith(paths);
            }
            if (this.subPathSnapshot[lastPath] === undefined) {
              // GOLD POSITION
              //this.subPathSnapshot[lastPath] = i;
              if (comparableSnapshots.length > 1) {
                if (cdnPage.getServerPublicConfig()['show_gold_only_snapshots']) {
                  this.subPathSnapshot[lastPath] = (i === length - 1 ? 0 : i + 1);

      // the same branch

    this.snapshotSubPathNames = snapNames;

              subPath: this.snapshotSubPaths[k],

            if (this.config.inheritance_selection && this.config.inheritance_selection !== true) {

          for (i = 0; i < position.length; i++) {

            if (this.config.hierarchical_separator) {

            }
            if (i === position.length - 1 || position[i + 1] === (collapsible_key ? -1 : 0)) {
              row.push({
                type: this.config.hierarchical_separator ? 'hierarchical_heading' : (collapsible_key ? 'collapse' : 'th'),
                title: position[i] < 0 ? '\xa0' : this.config.key[i].metrics[position[i]].title,
                replacements: position[i] < 0 ? null : this.config.key[i].metrics[position[i]].replacements,
                comparison: comparison,
                span: this.config.key.slice(i + 1).reduce(function(previousValue, currentValue) {

              titles.push(this.config.key[i].metrics[position[i]].title);
            }
          }
          this.prettyRowNames.push(this.snapshotSubPathNames[this.snapshotSubPaths[k]]+"\n"+titles.join("\n"));
          this.dataRowNames.push(this.snapshotSubPaths[k]+"\n"+replacements.join("\n"));
          if (k === 0) {

            if (rowConfig.metric) {
              for (j = 0; j < replacements.length; j++) {

          }
          // Increment position through keys
          for (i = position.length - 1; i >= 0; i--) {
            position[i]++;
            if (position[i] < this.config.key[i].metrics.length) {
              break;
            }
            if (collapsible_key) {
              position[i] = -1;
            } else {
              position[i] = 0;
            }
          }
          if (collapsible_key) {
            if (position.some(function(x){return x > -1;})) {
              continue;
            }
          } else if (position.some(function(x){return x > 0;})) {
            continue;
          }
          break;
        } while (true);
      } else {
        // Single metric value row
        row = [{
          type: 'snapshotHeading',
          comparison: new CDNMetricComparison('_name_', this.snapshotSubPaths[k]),
          subPath: this.snapshotSubPaths[k],
          branch: this.snapshotBranches[this.snapshotSubPaths[k]],
          span: 1,
          rowHeadingsEnd: true
        }];
        if (this.config.inheritance_selection && this.config.inheritance_selection !== true) {
          // Forced sub-path for the per-snapshot table container
          row[0].secondarySubPath = this.config.inheritance_selection;
        }
        this.prettyRowNames.push(this.snapshotSubPathNames[this.snapshotSubPaths[k]]);
        this.dataRowNames.push(this.snapshotSubPaths[k]);
        this.dataRows++;
        this.prototypeDescriptions.push(row);
        for (i = 0; i < this.config.ar_metric.length; i++) {
          comparison = this._metricComparison(this.config.ar_metric[i], this.snapshotSubPaths[k], comparableSnapshots.length > 1 ? this.nestedLastSubPaths[k] : '');
          if (collapsible_key && this.config.ar_metric[i].metric) {
            // We may have a key defined but no metrics were matched, remove the
            // % characters from the metric name so we show the "all" row
            metricName = this.config.ar_metric[i].metric;
            while (metricName.match(/(?:^|[^\\])(?:\\\\)*%/)) {
              metricName = removeFirstReplacement(metricName);
            }
            comparison = comparison.newRelatedComparison(metricName);
          }
          // TODO This will be complicated by group graph columns
          colIndex = this.prototypeDescriptions[0].length - (this.config.ar_metric.length - i);
          row.push({
            type: 'metricValue',
            comparison: comparison,
            config: this.config.ar_metric[i],
            groupCount: this.prototypeDescriptions[0][colIndex].groupCount,
            groupStart: this.prototypeDescriptions[0][colIndex].groupStart
          });
        }
      }
    }

    if (this.config.column_graph && cdnDataManager.getComparisonCount() > 1) {
      this._prepareColumnGraph();
    }

    this._addFooters();

    this.populateGroupAndColumnSummaries();

    if (this.table && this.table.parentNode === this.container) {
      this.draw();
    }

  };



  /********************************
   * nested sub path selection behavior
   */

  CDNTable.prototype._renderInheritanceSelection = function() {
    var form, label, span, select, option, i, j, selected, path, currentPath, parts, count, indent;

    function applyPathChange(event) {
      cdnPage.updateHash({path: select.value});
    }

    currentPath = cdnDataManager.getComparisonPath();
    count = cdnDataManager.getComparisonCount();

    form = document.createElement('form');
    form.addEventListener('submit', function(event) {
      event.preventDefault();
      applyPathChange(event);
    });
    form.className = 'cdn-table-filter-box';
    label = document.createElement('label');
    span = document.createElement('span');
    span.textContent = 'Show metrics for step:';
    label.appendChild(span);
    select = document.createElement('select');
    label.appendChild(select);
    option = document.createElement('option');
    option.value = '';
    option.textContent = count > 1 ? 'Last comparison step' : 'Top-level data';
    option.setAttribute('data-filter-list-all', 'yes');
    select.appendChild(option);
    parts = currentPath.split('/').filter(function(p){return !! p;});
    for (i = 0; i < parts.length; i++) {
      path = parts.slice(0, i + 1).join('/');
      option = document.createElement('option');
      option.value = path;
      indent = '';
      for (j = 0; j <= i; j++) {
        // Non-breaking space
        indent += '\xa0\xa0';
      }
      option.textContent = indent + parts[i];
      select.appendChild(option);
      if (path === currentPath) {
        option.selected = true;
        selected = true;
      }
    }
    for (i = 0; i < this.nestedSubPaths.length; i++) {
      path = this.nestedSubPaths[i];
      parts = path.split('/');
      option = document.createElement('option');
      option.value = path;
      indent = '';
      for (j = 0; j <= parts.length; j++) {
        // Non-breaking space
        indent += '\xa0\xa0';
      }
      option.textContent = indent + parts[parts.length - 1];
      select.appendChild(option);
      if (path === currentPath) {
        option.selected = true;
        selected = true;
      }
    }
    if (! selected) {
      select.firstChild.selected = true;
      select.setAttribute('data-filter-list-all', 'yes');
    }
    select.addEventListener('change', function(event) {
      if (select.value === '') {
        select.setAttribute('data-filter-list-all', 'yes');
      } else {
        select.removeAttribute('data-filter-list-all');
      }
      applyPathChange(event);
    }, false);
    form.appendChild(label);
    CDNHelpers.removeChildren(this.headerSelectionContainer);
    this.headerSelectionContainer.appendChild(form);
  };



  /********************************
   * Footers
   */

  CDNTable.prototype._addFooters = function() {
    var i, j, types, desc, comparisons, row, firstRow, comparison;

    comparisons = [];

    for (i = 1; i < this.prototypeDescriptions.length; i++) {
      for (j = this.leftHeadingCount; j < this.prototypeDescriptions[i].length; j++) {
        desc = this.prototypeDescriptions[i][j];
        if (desc && desc.type === 'metricValue' && desc.comparison) {
          if (! comparisons[j]) {
            comparisons[j] = [];
          }
          comparisons[j].push(desc.comparison);
        }
      }
    }
    this.summaryComparisons = comparisons;

    if (this.dataRows < 2) {
      return;
    }
    types = [];
    switch (this.dataRows) {
      case 0:
      case 1:
        return;
      case 2:
        if (! this.config.hide_footers) {
          if (cdnDataManager.getComparisonCount() > 1) {
            if (cdnPage.getMode() === cdnPage.MODE_AUM) {
              types.push(CDNMetricSummaryComparison.ALL_WINS_LOSSES);
            }
            types.push(CDNMetricSummaryComparison.WINS_LOSSES);
          }
          types.push(CDNMetricSummaryComparison.MEAN);
        }
        break;
      default:
        if (! this.config.hide_footers) {
          if (cdnDataManager.getComparisonCount() > 1) {
            if (cdnPage.getMode() === cdnPage.MODE_AUM) {
              types.push(CDNMetricSummaryComparison.ALL_WINS_LOSSES);
            }
            types.push(CDNMetricSummaryComparison.WINS_LOSSES);
          }
          if (cdnPage.getMode() !== cdnPage.MODE_AUM) {
            types.push(CDNMetricSummaryComparison.MINIMUM);
          }
          types.push(CDNMetricSummaryComparison.MEAN);
          if (cdnPage.getMode() !== cdnPage.MODE_AUM) {
            types.push(CDNMetricSummaryComparison.MAXIMUM);
          }
        }
        if (! this.config.hide_graph_footers) {
          types.push('graph');
        }
        break;
    }

    firstRow = true;
    for (i = 0; i < types.length; i++) {
      row = [];
      this.prototypeDescriptions.push(row);
      desc = {
        type: 'th',
        footerTitle: true,
        footerStart: firstRow
      };
      switch (types[i]) {
        case CDNMetricSummaryComparison.MINIMUM:
          desc.title = 'min';
          break;
        case CDNMetricSummaryComparison.MEAN:
          if (cdnPage.getMode() === cdnPage.MODE_AUM) {
            desc.title = 'average';
          } else {
            desc.title = 'avg';
          }
          break;
        case CDNMetricSummaryComparison.MAXIMUM:
          desc.title = 'max';
          break;
        case CDNMetricSummaryComparison.WINS_LOSSES:
          if (cdnPage.getMode() === cdnPage.MODE_AUM) {
            desc.title = 'big wins / big losses';
          } else {
            desc.title = 'wins / losses';
          }
          break;
        case CDNMetricSummaryComparison.ALL_WINS_LOSSES:
          desc.title = 'wins / losses';
          break;
        default:
          desc.title = types[i];
      }
      row.push(desc);

      for (j = this.leftHeadingCount; j < this.prototypeDescriptions[1].length; j++) {
        switch (types[i]) {
          case CDNMetricSummaryComparison.MINIMUM:
          case CDNMetricSummaryComparison.MEAN:
          case CDNMetricSummaryComparison.MAXIMUM:
            comparison = new CDNMetricSummaryComparison(types[i], comparisons[j]);
            row[j] = {
              type: 'metricValue',
              comparison: comparison,
              config: this.prototypeDescriptions[1][j].config,
              groupCount: this.prototypeDescriptions[0][j].groupCount,
              groupStart: this.prototypeDescriptions[0][j].groupStart,
              footerStart: firstRow
            };
            break;
          case CDNMetricSummaryComparison.WINS_LOSSES:
          case CDNMetricSummaryComparison.ALL_WINS_LOSSES:
            comparison = new CDNMetricSummaryComparison(types[i], comparisons[j]);
            row[j] = {
              type: 'winsLosses',
              comparison: comparison,
              config: this.prototypeDescriptions[1][j].config,
              groupCount: this.prototypeDescriptions[0][j].groupCount,
              groupStart: this.prototypeDescriptions[0][j].groupStart,
              footerStart: firstRow
            };
            break;
          default:
            row[j] = {
              type: 'graphLink',
              config: this.prototypeDescriptions[1][j].config,
              groupCount: this.prototypeDescriptions[0][j].groupCount,
              groupStart: this.prototypeDescriptions[0][j].groupStart,
              footerStart: firstRow,
              index: j - (this.prototypeDescriptions[0].length - this.config.ar_metric.length)
            };
            break;
        }
      }

      firstRow = false;
    }
  };



  /********************************
   * graph behavior
   */

  CDNTable.prototype.visibleGraphsFromConfig = function(config) {
    var i;
    for (i = 0; i < this.visibleGraphs.length; i++) {
      // Hide all graphs
      if (this.visibleGraphs === true) {
        this._toggleGraphForMetric(index, false);
      }
    }
    this.visibleGraphs = [];

    config = config || this.config;

    if (! config.ar_metric) {
      return this.visibleGraphs;
    }

    for (i = 0; i < config.ar_metric.length; i++) {
      if (config.ar_metric[i].show_graph) {
        this.visibleGraphs[i] = true;
      }
    }
    return this.visibleGraphs;
  };
  CDNTable.prototype.showVisibleGraphs = function() {
    var i, show;
    for (i = 0; i < this.visibleGraphs.length; i++) {
      // Get past the same value check
      show = !! this.visibleGraphs[i];
      this.visibleGraphs[i] = undefined;
      this._toggleGraphForMetric(i, show);
    }
  };
  CDNTable.prototype._toggleGraphForMetric = function(index, forceVisible, event) {
    var config, comparisons, cell, makeVisible, container;

    if (event) {
      event.preventDefault();
    }

    if (this.prototypeDescriptions.length <= 1) {
      // First row is headings, we need more than 1 row
      return;
    }

    config = this.config.ar_metric[index];
    comparisons = this.summaryComparisons[(this.prototypeDescriptions[1].length - this.config.ar_metric.length) + index];
    cell = this.graphLinks[index];

    switch (forceVisible) {
      case true:
      case false:
        makeVisible = forceVisible;
        break;
      default:
        makeVisible = ! this.visibleGraphs[index];
        break;
    }

    // _getGraphContainer hides the graph if that is requested
    container = this._getGraphContainer(index, cell, makeVisible);

    if (this.visibleGraphs[index] === makeVisible) {
      return;
    }

    this.visibleGraphs[index] = makeVisible;

    if (makeVisible && container) {
      switch (config.graph_type) {
        case 'treemap':
          this._prepareTreemap(index, config, comparisons, cell, container);
          break;
        case 'none':
          cell && cell.removeAttribute('data-fetching');
          break;
        case 'line':
        default:
          this._prepareLineGraph(index, config, comparisons, cell, container);
          break;
      }
    }
  };

  CDNTable.prototype._getGraphContainer = function(index, cell, makeVisible) {
    var container, node, nodeMetric, metricName, nodeHeader, headerName, i;

    metricName = this.config.ar_metric[index].metric;
    headerName = this.config.ar_metric[index].header;

    node = this.footerContainer.firstChild;
    while (node) {
      if (node.nodeType === node.ELEMENT_NODE &&
          (node.getAttribute('data-graph-metric') === metricName || node.getAttribute('data-graph-header') === headerName)) {
        if (makeVisible) {
          cell && cell.setAttribute('data-graph-open', 'yes');
          return node;
        } else {
          this.footerContainer.removeChild(node);
          cell && cell.removeAttribute('data-graph-open');
          cell && cell.removeAttribute('data-fetching');
          return;
        }
      }
      node = node.nextSibling;
    }

    if (! makeVisible) {
      cell && cell.removeAttribute('data-graph-open');
      return;
    }

    cell && cell.setAttribute('data-fetching', 'yes');
    cell && cell.setAttribute('data-graph-open', 'yes');

    container = document.createElement('div');
    container.className = 'cdn-horiz-graph-container';
    if (headerName) {
      container.setAttribute('data-graph-header', headerName);
    } else {
      container.setAttribute('data-graph-metric', metricName);
    }

    // Find container insertion point
    node = null;
    if (index < this.config.ar_metric.length - 1) {
      node = this.footerContainer.firstChild;
      nodeLoop: while (node) {
        if (node.nodeType === node.ELEMENT_NODE) {
          nodeMetric = node.getAttribute('data-graph-metric');
          nodeHeader = node.getAttribute('data-graph-header');
          for (i = index + 1; i < this.config.ar_metric.length; i++) {
            if (nodeMetric === this.config.ar_metric[i].metric || nodeHeader === this.config.ar_metric[i].header) {
              break nodeLoop;
            }
          }
        }
        node = node.nextSibling;
      }
    }
    this.footerContainer.insertBefore(container, node);
    return container;
  };

  CDNTable.prototype._prepareLineGraph = function(index, config, comparisons, cell, container) {
    if (cdnDataManager.getComparisonMethod() === cdnDataManager.COMPARE_RUNS) {
      // Hopefully shortcut any fetches by fetching the comparable objects at the
      // current level so the metric comparisons don't have to fetch the
      // individual subPaths.
      cdnDataManager.getComparableThings(function(){});
    }
    CDNHelpers.waitForAll(comparisons, function(comparison, intermediate) {
      comparison.getValueDescriptions(intermediate);
    }.bind(this), this._renderLineGraph.bind(this, index, config, comparisons, cell, container));
  };

  CDNTable.prototype._renderLineGraph = function(index, config, comparisons, cell, container, allValues) {
    var i, j, keys, timeGraph, times, total, path, runIds, names, seconds, configuration, dataPoints, legendWidth, firstLabelGutter, yAxisGutter, yAxisName, xAxisLabels, xAxisCount;

    cell && cell.removeAttribute('data-fetching');

    timeGraph = new CDNChart_line();

    runIds = cdnDataManager.getComparableLabels();
    // GOLD POSITION
    runIds.unshift(runIds.pop());
    names = {};

    xAxisLabels = {};
    xAxisCount = 0;

    times = [];
    keys = [];
    if (this.config.per_snapshot && this.config.key && this.config.key.length) {
      keys = this.keyNames;
      times = keys.map(function(key, i) {
        names[CDNColor.get(i)] = key;
        return {
          name: key,
          data: {}
        }
      });
      xAxisLabels = this.snapshotSubPathNames;
      xAxisCount = this.snapshotSubPaths.length;
      allValues.map(function(comparableDescription, i){
        var pathName, rowName, description, key, keyIndex;
        if (comparableDescription) {
          // TODO: comparisons
          description = comparableDescription[0];
          keyIndex = i % this.keyNames.length;
          if (description && description.defined && description.number) {
            rowName = this.snapshotSubPaths[Math.floor(i / this.keyNames.length)];
            times[keyIndex].data[rowName] = description.rawValue;
            if (description.rawUnits === 's') {
              seconds = true;
            }
          }
        }
      }.bind(this));
    } else {
      for (i = 0; i < runIds.length; i++) {
        names[CDNColor.get(i)] = runIds[i];
      }
      for (i = 0; i < this.dataRowNames.length; i++) {
        xAxisLabels[this.dataRowNames[i]] = this.prettyRowNames[i];
      }
      xAxisCount = this.dataRowNames.length;
      allValues.map(function(comparableDescription, i){
        var pathName, rowName;
        if (comparableDescription) {
          comparableDescription.map(function(description, j){
            if (! times[j]) {
              times[j] = {
                name: runIds[j],
                data: {}
              };
            }
            if (description && description.defined && description.number) {
              rowName = this.dataRowNames[i];
              times[j].data[rowName] = description.rawValue;
              if (description.rawUnits === 's') {
                seconds = true;
              }
            }
          }.bind(this));
        }
      }.bind(this));
