  CDNDataCell.renderValue = function(value, targetUnits) {
    var rawValue, number, unitMatch, units;

    function multi(siPrefix) {
      if (siPrefix.length < 2) {
        return 1;
      }
      switch (siPrefix.substr(0, 1)) {
        case 'Y': return 1e24;
        case 'Z': return 1e21;
        case 'E': return 1e18;
        case 'P': return 1e15;
        case 'T': return 1e12;
        case 'G': return 1e9;
        case 'M': return 1e6;
        case 'k': return 1e3;
        case 'h': return 1e2;
        case 'd': return 1e-1;
        case 'c': return 1e-2;
        case 'm': return 1e-3;
        case 'u': return 1e-6;
        case 'n': return 1e-9;
        case 'p': return 1e-12;
        case 'f': return 1e-15;
        case 'a': return 1e-18;
        case 'z': return 1e-21;
        case 'y': return 1e-24;
        default:  return 1;
      }
    }

    function sameBaseUnit(a, b) {
      var aBase, bBase;
      // Test we have non-empty strings
      if (! a || ! b || (''+a) !== a || (''+b) !== b) {
        return false;
      }
      a = a.toUpperCase();
      b = b.toUpperCase();
      aBase = a.substr(1);
      bBase = b.substr(1);
      if (a === b) {return true;}
      if (aBase === b) {return true;}
      if (a === bBase) {return true;}
      if (aBase === bBase) {return true;}
      return false;
    }

    rawValue = value;
    number = false;

    // Value looks like a float (matches 3.5, 3e5, 3.5E-7 but not integers)
    if (value && (''+value)===value && value.match(/^[-\+]?[0-9]+(\.[0-9]+|(\.[0-9]+)?[eE][-\+]?[0-9]+)(\s|$)/)) {
      rawValue = parseFloat(value, 10);
      number = true;

    // Value looks like an integer
    } else if (value && (''+value)===value && value.match(/^[-\+]?[0-9]+(\s|$)/)) {
      rawValue = parseInt(value, 10);
      number = true;
    }

    // Defend against parseInt/parseFloat failing
    if (isNaN(rawValue)) {
      rawValue = value;
      number = false;
    }

    if (number) {
      unitMatch = value.match(/^[0-9\-\+\.eE]+\s+(.+)/);
      units = "";
      if (unitMatch && unitMatch[1]) {
        units = unitMatch[1];
      }
      if (targetUnits === '%') {
        if (units !== '%') {
          rawValue *= 100;
        }
      } else {
        // Pull the units off the end of the value
        if (units && targetUnits && sameBaseUnit(units, targetUnits)) {
          // Multiply the value so we compare the same units
          rawValue *= multi(units) / multi(targetUnits);
        }
      }
    }

    return {
      rawValue: rawValue,
      isNumber: number,
      units: units
    };
  };

  CDNDataCell.renderSeconds = function(value, precision) {
    var toFixed = false, time, minutes, seconds;
    if (precision !== undefined) {
      toFixed = true;
    }
    // Hours
    time = [Math.floor(value / 3600)];
    // Minutes
    minutes = Math.floor((value % 3600) / 60);
    if (minutes < 10) {
      time.push('0' + minutes);
    } else {
      time.push(minutes);
    }
    // Seconds
    seconds = value % 60;
    if (toFixed) {
      seconds = seconds.toFixed(precision);
    }
    if (seconds < 10) {
      time.push('0' + seconds);
    } else {
      time.push(seconds);
    }
    return time.join(':');
  };

  CDNDataCell.numberWithCommas = function(x) {
    var parts = x.toString().split(".");
    parts[0] = parts[0].replace(/\B(?=(\d{3})+(?!\d))/g, ",");
    return parts.join(".");
  };

  /* Value normalizer for CDNMetricComparison */
  CDNDataCell.normalize = function(metric, metricConfig, description) {
    var rendered, rawThreshold;
    // _name_ metric does not have a metricConfig so we cannot assume one exists
    description.rawUnits = metricConfig ? metricConfig.units || '' : '';
    if (metric) {
      rendered = CDNDataCell.renderValue(metric.value, description.rawUnits);
    }
    rawThreshold = 0;
    if (metricConfig && metricConfig.threshold) {
      // Turn our threshold into a number
      rawThreshold = CDNDataCell.renderValue(metricConfig.threshold, description.rawUnits);
      description.threshold = rawThreshold;
      if (rawThreshold.isNumber) {
        rawThreshold = rawThreshold.rawValue;
        // Make sure the threshold is positive
        if (rawThreshold < 0) { rawThreshold *= -1 }
      } else {
        rawThreshold = 0;
      }
    }
    description.rawThreshold = rawThreshold;
    if (metric) {
      description.number = rendered.isNumber;
      description.rawValue = rendered.rawValue;
      description.inherited = metric.inherited;
    }
    if (description.number && description.rawUnits === 's') {
      description.renderedValue = CDNDataCell.renderSeconds(description.rawValue, metricConfig && metricConfig.dp || 0);
    } else if (description.number) {
      description.renderedValue = CDNDataCell.numberWithCommas(description.rawValue.toFixed(metricConfig && metricConfig.dp || 0));
    } else {
      description.renderedValue = description.rawValue === undefined ? '' : description.rawValue;
    }
    return description.rawValue;
  };

  window.CDNDataCell = CDNDataCell;

  window.CDNMetricComparison.registerCellRenderer(undefined, CDNDataCell);
})();

(function() {

  function CDNBooleanCell(metricComparison) {
    this.extended.apply(this, arguments);
  }
  CDNHelpers.extend(CDNCellRenderer, CDNBooleanCell);

  CDNBooleanCell.prototype.renderCellContents = function() {
    var i, length, value, imgContainer;

    for (i = 0; i < this.values.length; i++) {
      if (! this.cells[i * 2]) { continue; }
      this.cells[(i * 2) + 1].style.display = 'none';
      this.cells[i * 2].colSpan = 2;
      CDNHelpers.removeChildren(this.cells[i * 2]);

      if (this.values[i].defined) {
        imgContainer = document.createElement('div');
        imgContainer.className = 'cdn-boolean-cell-image';
        /* coerce the value to a boolean, following js and tcl rules ('0' = false,
         * 'false' = false) */
        imgContainer.setAttribute('data-boolean-value', this.values[i].rawValue ? 'pass' : 'fail');
        imgContainer.alt = this.values[i].rawValue ? 'Pass' : 'Fail';
        this.cells[i * 2].appendChild(imgContainer);
      }

      this.cells[i * 2].setAttribute('data-metric', this.values[i].name);
      this.cells[i * 2].title = '';
      if (! this.values[i].singleMetric) {
        if (this.values[i].gold) {
          this.cells[i * 2].setAttribute('data-metric-compare', 'gold');
        } else {
          this.cells[i * 2].setAttribute('data-metric-compare', this.values[i].relation);
        }
      } else if (this.pageConfig.color_met_target || this.values[i].targetRelation === CDNMetricComparison.BAD || this.values[i].targetRelation === CDNMetricComparison.WARNING) {
        this.cells[i * 2].setAttribute('data-metric-compare', this.values[i].targetRelation);
        switch (CDNMetricComparison.resolveComparison(this.values[i].cmp)) {
        case CDNMetricComparison.CMP_LARGER:
        case CDNMetricComparison.CMP_LARGER_LIMITED:
          this.cells[i * 2].title = 'Below target of '+this.values[i].target;
          break;
        case CDNMetricComparison.CMP_SMALLER:
        case CDNMetricComparison.CMP_SMALLER_LIMITED:
          this.cells[i * 2].title = 'Above target of '+this.values[i].target;
          break;
        }
      } else {
        this.cells[i * 2].removeAttribute('data-metric-compare');
      }
    }
  };


  /* Value normalizer for CDNMetricComparison */
  CDNBooleanCell.normalize = function(metric, metricConfig, description) {
    var value, pass;
    value = metric ? metric.value : metric.rawValue;
    if (value === undefined) {
      return undefined;
    }
    // Coerce to boolean,
    // Take 'false' as false.
    // If value is a number then coerce to number, then to boolean ('0' is false)
    pass = !! value && value !== 'false' && isNaN(value) || !! +value;
    description.renderedValue = pass;
    return pass;
  };

  window.CDNBooleanCell = CDNBooleanCell;

  window.CDNMetricComparison.registerCellRenderer('bool', CDNBooleanCell);

})();

(function() {

  function CDNAlertCell(metricComparison) {

    valueCell.appendChild(ul);
    for (i = 0; i < value.renderedValue.length; i++) {
      li = document.createElement('li');
      li.textContent = value.renderedValue[i];
      ul.appendChild(li);
    }
  };

  /* Value normalizer for CDNMetricComparison */
  CDNAlertCell.normalize = function(metric, metricConfig, description) {
    var list, keys, key, i, ordered;
    description.number = false;
    if (metric) {
      description.inherited = metric.inherited;
    }
    if (description.rawValue) {
      list = CDNHelpers.parseTclDict(description.rawValue);
      // Sort by key alphabetically so that we compare like for like
      keys = CDNHelpers.keys(list).sort();
      ordered = {};
      description.rawValue = [];
      for (i = 0; i < keys.length; i++) {
        key = keys[i];
        ordered[key] = list[key];
        description.rawValue.push('{'+key+'}', '{'+list[key]+'}');
      }
      description.rawValue = description.rawValue.join(' ');
      description.renderedValue = CDNHelpers.values(ordered);
    }
    return description.rawValue;
  };

  window.CDNMetricComparison.registerCellRenderer('alert', CDNAlertCell);

    <script type="text/javascript">"use strict";

(function() {

  function CDNMessagesCell(metricComparison) {
    this.extended.apply(this, arguments);
    this.className = 'cdn-messages-cell-renderer';
  }
  CDNHelpers.extend(CDNDataCell, CDNMessagesCell);

  CDNMessagesCell.prototype.setPopover = function(index, event) {
    // Disable the hover popup
  };

  CDNMessagesCell.prototype.applyCells = function(cells) {
    var that = this, i;

    function addMouseHandler(cell, index) {
      cell.addEventListener('click', that.openPopup.bind(that, index));
    }

    this.extended.prototype.applyCells.apply(this, arguments);

    for (i = 0; i < this.cells.length; i++) {
      addMouseHandler(this.cells[i], i);
    }

    return this.cells;
  };

  CDNMessagesCell.prototype.renderCellContents = function() {
    var valueCell, deltaCell, i;

    this.applyCustomComparison(this.values);

    this.extended.prototype.renderCellContents.apply(this, arguments);

    if (this.values.length === 1) {
      valueCell = this.cells[0];
      deltaCell = this.cells[1];
      if (this.values[0].errorCount > 0) {
        valueCell.setAttribute('data-metric-compare', CDNMetricComparison.BAD);
        deltaCell.setAttribute('data-metric-compare', CDNMetricComparison.BAD);
      } else if (this.values[0].warningCount > 0) {
        valueCell.setAttribute('data-metric-compare', CDNMetricComparison.GOLD);
        deltaCell.setAttribute('data-metric-compare', CDNMetricComparison.GOLD);
      }
    }
  };

  CDNMessagesCell.prototype.applyCustomComparison = function(values) {
    var i, gold, value, worstError, worstWarning, worstDifference;
    if (values.length > 1) {
      gold = values[values.length - 1];
      for (i = 0; i < values.length - 1; i++) {
        value = values[i];
        if (! value.defined || ! gold.defined) {
          value.relation = CDNMetricComparison.NEUTRAL;
          continue;
        }
        // Look at error count
        worstError = CDNHelpers.values(this.extractDifference(value.errorIdCount, gold.errorIdCount)).reduce(function(previous, value) {
          return Math.max(previous, value);
        }, -Infinity);
        worstWarning = CDNHelpers.values(this.extractDifference(value.warningIdCount, gold.warningIdCount)).reduce(function(previous, value) {
          return Math.max(previous, value);
        }, -Infinity);
        worstDifference = Math.max(worstError, worstWarning);
        if (worstDifference > -Infinity && worstDifference !== 0) {
          if (worstDifference > 0) {
            value.relation = CDNMetricComparison.BAD;
          } else {
            value.relation = CDNMetricComparison.GOOD;
          }
        } else {
          value.relation = CDNMetricComparison.NEUTRAL;
        }
      }
    }
  };

  CDNMessagesCell.prototype.extractDifference = function(value, gold) {
    var differences, key;
    differences = {};
    for (key in value) {
      if (key in gold) {
        if (value[key] !== gold[key]) {
          differences[key] = value[key] - gold[key];
        }
      } else {
        differences[key] = value[key];
      }
    }
    for (key in gold) {
      if (!(key in value)) {
        differences[key] = -gold[key];
      }
    }
    return differences;
  };

  CDNMessagesCell.prototype.fillValueCell = function(valueCell, index, value) {
    var errorSpan, warningSpan;
    CDNHelpers.removeChildren(valueCell);
    if (! value.defined) {
      return;
    }
    errorSpan = document.createElement('span');
    errorSpan.textContent = 'e:'+value.errorCount;
    if (value.errorCount > 0) {
      errorSpan.setAttribute('data-cdn-messages-has-errors', 'yes');
    }
    valueCell.appendChild(errorSpan);
    warningSpan = document.createElement('span');
    warningSpan.textContent = 'w:'+value.warningCount;
    if (value.warningCount > 0) {
      warningSpan.setAttribute('data-cdn-messages-has-warnings', 'yes');
    }
    valueCell.appendChild(warningSpan);
  };

  CDNMessagesCell.prototype.openPopup = function(index) {
    var value, table, tr, td, i, j, props, message, modal;
    value = this.values[Math.floor(index / 2)];

    table = document.createElement('table');
    table.className = 'cdn-messages-table';
    tr = document.createElement('tr');
    table.appendChild(tr);
    props = ['Type', '#num', 'Msg ID', 'Message'];
    for (i = 0; i < props.length; i++) {
      td = document.createElement('th');
      td.textContent = props[i];
      tr.appendChild(td);
    }
    props = ['severity', 'count', 'id', 'short'];
    for (i = 0; i < value.renderedValue.length; i++) {
      tr = document.createElement('tr');
      table.appendChild(tr);
      message = value.renderedValue[i];
      for (j = 0; j < props.length; j++) {
        td = document.createElement('td');
        td.textContent = message[props[j]];
        td.className = 'cdn-messages-table-'+props[j];
        tr.appendChild(td);
      }
    }

    modal = new CDNModal(table);
    modal.show();
  };

  /* Value normalizer for CDNMetricComparison */
  CDNMessagesCell.normalize = function(metric, metricConfig, description) {
    var list, i, ordered;
    description.number = false;
    if (metric) {
      description.inherited = metric.inherited;
    }
    list = CDNHelpers.parseTclList(description.rawValue).map(CDNHelpers.parseTclDict).map(function(message) {
      if (message.severity) {
        message.severity = ('' + message.severity).toLowerCase()
      }
      return message;
    });
    description.errorCount = 0;
    description.warningCount = 0;
    description.errorIdCount = {};
    description.warningIdCount = {};
    list.map(function(message) {
      switch (message.severity) {
        case 'error':
          description.errorCount += +message.count;
          if (! description.errorIdCount[message.id]) {
            description.errorIdCount[message.id] = 0;
          }
          description.errorIdCount[message.id] += +message.count;
          break;
        case 'warning':
        case 'warn':
          description.warningCount += +message.count;
          if (! description.warningIdCount[message.id]) {
            description.warningIdCount[message.id] = 0;
          }
          description.warningIdCount[message.id] += +message.count;
          break;
      }
    });
    ordered = list.sort(function(a, b) {
      if (a.severity !== b.severity) {
        if (a.severity === 'error') {
          return -1;
        } else if (b.severity === 'error') {
          return 1;
        } else if (a.severity === 'warning' || a.severity === 'warn') {
          return -1;
        } else if (b.severity === 'warning' || b.severity === 'warn') {
          return 1;
        }
      }
      if (a.id > b.id) {
        return 1;
      } else if (a.id < b.id) {
        return -1;
      } else {
        return 0;
      }
    });
    description.renderedValue = ordered;
    return description.rawValue;
  };

  window.CDNMessagesCell = CDNMessagesCell;

  window.CDNMetricComparison.registerCellRenderer('messages', CDNMessagesCell);

})();

(function() {

  function CDNImageCell(metricComparison) {
    this.urls = [];
    CDNCellRenderer.apply(this, arguments);
  }
  CDNHelpers.extend(CDNCellRenderer,CDNImageCell);

  CDNImageCell.prototype.valuesUpdated = function(values) {
    var that = this, runIds;

    runIds = cdnDataManager.getRunIds();

    this.values = values;
    this.urls = this.values.map(function(value, index) {
      return that.getUrl(value, runIds[index]);
    });
    this.renderCellContents();
  };

  CDNImageCell.prototype.renderCellContents = function() {
    var i, showPercent, valueCell, deltaCell;

    showPercent = cdnPage.getDeltaPresentationMode() === 'percentDiff';

    for (i = 0; i < this.values.length; i++) {
      valueCell = this.cells[i * 2];
      deltaCell = this.cells[(i * 2) + 1];
      if (! valueCell) { continue; }
      this.fillValueCell(valueCell, i, this.values[i], this.urls[i]);
      deltaCell.style.display = 'none';
      valueCell.removeAttribute('data-has-delta-cell');
      valueCell.colSpan = 2;
      valueCell.title = '';
      deltaCell.title = '';
      if (! this.values[i].singleMetric) {
        if (this.values[i].gold) {
          valueCell.setAttribute('data-metric-compare', 'gold');
          deltaCell.setAttribute('data-metric-compare', 'gold');
        } else {
          valueCell.setAttribute('data-metric-compare', this.values[i].relation);
          deltaCell.setAttribute('data-metric-compare', this.values[i].relation);
        }
      } else if (this.pageConfig.color_met_target || this.values[i].targetRelation === CDNMetricComparison.BAD || this.values[i].targetRelation === CDNMetricComparison.WARNING) {
        valueCell.setAttribute('data-metric-compare', this.values[i].targetRelation);
        deltaCell.setAttribute('data-metric-compare', this.values[i].targetRelation);
        switch (CDNMetricComparison.resolveComparison(this.values[i].cmp)) {
        case CDNMetricComparison.CMP_LARGER:
        case CDNMetricComparison.CMP_LARGER_LIMITED:
          valueCell.title = 'Below target of '+this.values[i].target;
          deltaCell.title = 'Below target of '+this.values[i].target;
          break;
        case CDNMetricComparison.CMP_SMALLER:
        case CDNMetricComparison.CMP_SMALLER_LIMITED:
          valueCell.title = 'Above target of '+this.values[i].target;
          deltaCell.title = 'Above target of '+this.values[i].target;
          break;
        }
      } else {
        valueCell.removeAttribute('data-metric-compare');
        deltaCell.removeAttribute('data-metric-compare');
      }
      valueCell.setAttribute('data-metric', this.values[i].name);
      valueCell.setAttribute('data-metric-type', 'image');
      deltaCell.setAttribute('data-metric', this.values[i].name);
      deltaCell.setAttribute('data-metric-type', 'image');
    }
  };

  CDNImageCell.prototype.fillValueCell = function(valueCell, index, value, url) {
    var img;

    if (url) {
      img = valueCell.firstChild;
      if (! img || img.nodeName !== 'IMG') {
        img = this.createImageNode(valueCell, index);
      }
      img.src = url;
    } else {
      CDNHelpers.removeChildren(valueCell);
    }
  };

  CDNImageCell.prototype.getUrl = function(value, runId) {
    var url = null;
    if (! value || ! value.rawValue) {
      return url;
    } else if (value.value === value.rawValue) {
      // not a metadata image
      url = value.value;
      if (url[0] === '/' && ! url.match(/:\/\//)) {
        url = 'file://' + url;
      }
    } else {
      if (cdnPage.getMode() === cdnPage.MODE_SUM) {
        // Ignore metadata information - no AUM to serve the image
        url = value.value;
        if (url[0] === '/' && ! url.match(/:\/\//)) {
          url = 'file://' + url;
        }
      } else {
        // AUM - use the image endpoint
        url = cdnDataManager.getApiRoot() + '/image/' + runId + '/' + value.rawValue;
      }
    }
    return url;
  };

  CDNImageCell.prototype.createImageNode = function(valueCell, index) {
    var img;
    CDNHelpers.removeChildren(valueCell);
    img = document.createElement('img');
    valueCell.appendChild(img);

    img.addEventListener('click', this.expand.bind(this, index), false);

    return img;
  };

  CDNImageCell.prototype.expand = function(index, event) {
    var modal, config;
    event.preventDefault();

    config = {
      images: this.urls.map(function(u){return {url: u};}),
      startingIndex: index
    };

    modal = new CDNImageDiffCarousel(config);
    modal.show();
  };

  /* Value normalizer for CDNMetricComparison */
  CDNImageCell.normalize = function(metric, metricConfig, description) {
    if (metric && metric.metadata && metric.metadata.id) {
      return metric.metadata.id;
    } else if (metric) {
      return metric.value;
    } else {
      return description.rawValue || undefined;
    }
  };

  window.CDNImageCell = CDNImageCell;

  window.CDNMetricComparison.registerCellRenderer('image', CDNImageCell);
})();

(function() {

  function CDNTimeCell(metricComparison) {
    this.excluded = [];
    CDNDataCell.apply(this, arguments);
  }
  CDNHelpers.extend(CDNDataCell,CDNTimeCell);

  CDNTimeCell.prototype.applyCells = function(cells, pageConfig) {
    var that = this, i, length, cell;

    this.pageConfig = pageConfig;
    this.cells = cells;

    if (this.className) {
      for (i = 0; i < this.cells.length; i++) {
        this.cells[i].className = this.className;
      }

    CDNHelpers.waitForAll([0, 1], function(index, intermediateCallback) {
      var newComparison;
      if (index === 0) {
        that.metricComparison.getValueDescriptions(intermediateCallback);

// Top-level function so we can have a per-file var scope
(function() {

  function CDNHtmlCell(metricComparison) {
    this.metricConfig = undefined;
    CDNCellRenderer.apply(this, arguments);

    if (metricComparison) {
      this._renderCellContentsBound = this.renderCellContents.bind(this);
      CDNHelpers.events.add('cdnpresentationchanged', this._renderCellContentsBound);
    }
  }
  CDNHelpers.extend(CDNCellRenderer,CDNHtmlCell);

  CDNHtmlCell.prototype.finalize = function() {
    CDNHelpers.events.remove('cdnpresentationchanged', this._renderCellContentsBound);
  };

  CDNHtmlCell.prototype.applyCells = function(cells, pageConfig) {
    var i, length, cell, calls;

    this.pageConfig = pageConfig;
    this.cells = cells;

    if (this.className) {
      for (i = 0; i < this.cells.length; i++) {
        this.cells[i].className = this.className;
      }
    }

    calls = [
      this.metricComparison.getValueDescriptions.bind(this.metricComparison),
      this.metricComparison.getMetricConfig.bind(this.metricComparison)

    CDNHelpers.waitForAll(calls, function(call, intermediateCallback) {
      call(intermediateCallback);
    }, this.valuesUpdated.bind(this));

    return this.cells;
  };

  CDNHtmlCell.prototype.valuesUpdated = function(callReturns) {
    this.values = callReturns[0];
    this.metricConfig = callReturns[1];
    this.renderCellContents();
  };

  CDNHtmlCell.prototype.renderCellContents = function() {
    var i, showPercent, valueCell, deltaCell;

    showPercent = cdnPage.getDeltaPresentationMode() === 'percentDiff';

    for (i = 0; i < this.values.length; i++) {
      valueCell = this.cells[i * 2];
      deltaCell = this.cells[(i * 2) + 1];
      if (! valueCell) { continue; }
      this.fillValueCell(valueCell, i, this.values[i]);
      if (! this.values[i].gold && this.values[i].percentDiff !== '') {
        deltaCell.className = 'cdn-metric-delta';
        this.fillDeltaCell(deltaCell, i, this.values[i], showPercent);
        deltaCell.style.display = '';
        valueCell.colSpan = 1;
        valueCell.setAttribute('data-has-delta-cell', 'yes');
      } else if (deltaCell) {
        deltaCell.style.display = 'none';
        valueCell.removeAttribute('data-has-delta-cell', 'yes');
        valueCell.colSpan = 2;
      }
      valueCell.title = '';
      deltaCell.title = '';
      if (! this.values[i].singleMetric) {
        if (this.values[i].gold) {
          valueCell.setAttribute('data-metric-compare', 'gold');
          deltaCell.setAttribute('data-metric-compare', 'gold');
        } else {
          valueCell.setAttribute('data-metric-compare', this.values[i].relation);
          deltaCell.setAttribute('data-metric-compare', this.values[i].relation);
        }
      } else if (this.pageConfig.color_met_target || this.values[i].targetRelation === CDNMetricComparison.BAD || this.values[i].targetRelation === CDNMetricComparison.WARNING) {
        valueCell.setAttribute('data-metric-compare', this.values[i].targetRelation);
        deltaCell.setAttribute('data-metric-compare', this.values[i].targetRelation);
        switch (CDNMetricComparison.resolveComparison(this.values[i].cmp)) {
        case CDNMetricComparison.CMP_LARGER:
        case CDNMetricComparison.CMP_LARGER_LIMITED:
          valueCell.title = 'Below target of '+this.values[i].target;
          deltaCell.title = 'Below target of '+this.values[i].target;
          break;
        case CDNMetricComparison.CMP_SMALLER:
        case CDNMetricComparison.CMP_SMALLER_LIMITED:
          valueCell.title = 'Above target of '+this.values[i].target;
          deltaCell.title = 'Above target of '+this.values[i].target;
          break;
        }
      } else {
        valueCell.removeAttribute('data-metric-compare');
        deltaCell.removeAttribute('data-metric-compare');
      }
      valueCell.setAttribute('data-metric', this.values[i].name);
      valueCell.setAttribute('data-metric-value-type', this.values[i].number ? 'number' : 'string');
      deltaCell.setAttribute('data-metric', this.values[i].name);
      deltaCell.setAttribute('data-metric-value-type', this.values[i].number ? 'number' : 'string');
      if (this.metricConfig && this.metricConfig.type) {
        valueCell.setAttribute('data-metric-type', this.metricConfig.type);
        deltaCell.setAttribute('data-metric-type', this.metricConfig.type);
      } else {

  CDNHtmlCell.prototype.fillValueCell = function(valueCell, index, value) {
    // Prevent script, style, embed, object tags

  CDNHtmlCell.prototype.fillDeltaCell = function(deltaCell, index, value, showPercent) {
    var span;
    CDNHelpers.removeChildren(deltaCell);
    span = document.createElement('span');

      span.textContent = value.percentDiff;
    } else {

    }
    deltaCell.appendChild(span);

  CDNHtmlCell.renderValue = function(value, targetUnits) {
    var rawValue, number, unitMatch, units;

    function multi(siPrefix) {
      if (siPrefix.length < 2) {
        return 1;
      }
      switch (siPrefix.substr(0, 1)) {
        case 'Y': return 1e24;
        case 'Z': return 1e21;
        case 'E': return 1e18;
        case 'P': return 1e15;
        case 'T': return 1e12;
        case 'G': return 1e9;
        case 'M': return 1e6;
        case 'k': return 1e3;
        case 'h': return 1e2;
        case 'd': return 1e-1;
        case 'c': return 1e-2;
        case 'm': return 1e-3;
        case 'u': return 1e-6;
        case 'n': return 1e-9;
        case 'p': return 1e-12;
        case 'f': return 1e-15;
        case 'a': return 1e-18;
        case 'z': return 1e-21;
        case 'y': return 1e-24;
        default:  return 1;
      }
    }

    rawValue = value;
    number = false;

    // Value looks like a float (matches 3.5, 3e5, 3.5E-7 but not integers)
    if (value && (''+value)===value && value.match(/^[-\+]?[0-9]+(\.[0-9]+|(\.[0-9]+)?[eE][-\+]?[0-9]+)(\s|$)/)) {
      rawValue = parseFloat(value, 10);
      number = true;

    // Value looks like an integer
    } else if (value && (''+value)===value && value.match(/^[-\+]?[0-9]+(\s|$)/)) {
      rawValue = parseInt(value, 10);
      number = true;
    }

    // Defend against parseInt/parseFloat failing
    if (isNaN(rawValue)) {
      rawValue = value;
      number = false;
    }

    if (number) {
      if (targetUnits === '%') {
        rawValue *= 100;
      } else {
        // Pull the units off the end of the value
        unitMatch = value.match(/^[0-9\-\+\.eE]+\s+(.+)/);
        if (unitMatch && unitMatch[1]) {
          units = unitMatch[1];
          // Multiply the value so we compare the same units
          rawValue *= multi(units) / multi(targetUnits);
        }
      }
    }

    return {
      rawValue: rawValue,
      isNumber: number
    };
  };

  /* Value normalizer for CDNMetricComparison */
  CDNHtmlCell.normalize = function(metric, metricConfig, description) {
    var rendered, rawThreshold
    // _name_ metric does not have a metricConfig so we cannot assume one exists
    description.rawUnits = metricConfig ? metricConfig.units || '' : '';
    if (metric) {
      rendered = CDNHtmlCell.renderValue(document.createRange().createContextualFragment(metric.value), description.rawUnits);
    }
    rawThreshold = 0;
    if (metricConfig && metricConfig.threshold) {
      // Turn our threshold into a number
      rawThreshold = CDNHtmlCell.renderValue(metricConfig.threshold, description.rawUnits);
      if (rawThreshold.isNumber) {
        rawThreshold = rawThreshold.rawValue;
        // Make sure the threshold is positive
        if (rawThreshold < 0) { rawThreshold *= -1 }
      } else {
        rawThreshold = 0;
      }
    }
    description.rawThreshold = rawThreshold;
    if (metric) {
      description.number = rendered.isNumber;
      description.rawValue = rendered.rawValue;
      description.inherited = metric.inherited;
    }
    description.renderedValue = metric.value;
    return description.rawValue;
  };

  window.CDNHtmlCell = CDNHtmlCell;

  window.CDNMetricComparison.registerCellRenderer('html', CDNHtmlCell);
})();

(function() {

  function CDNSlackCell(metricComparison) {
    CDNDataCell.apply(this, arguments);

  CDNSlackCell.prototype.fillValueCell = function(valueCell, index, value) {
    var rootPrefix, viewGroup, parts;
    valueCell.textContent = value.renderedValue;
    if (value.defined && !(this.metricComparison instanceof CDNMetricSummaryComparison)) {
      // Our timing metric will follow the format:
      //   timing.setup.wns.view:view.group:group
      //   timing.hold.tns.group:group
      //   timing.setup.wns
      // Paths are at:
      //   timing.setup.paths.view:view.group:group
      //   timing.hold.paths.group:group
      //   timing.setuo.paths
      // Histograms are at:
      //   timing.setup.histogram
      //   timing.hold.histogram
      // Split on not-escaped period
      parts = this.metricComparison.metric.split(/(?:\\\\)*\./);
      rootPrefix = parts.slice(0, 2).join('.');
      viewGroup = parts.slice(3).join('.');
      if (viewGroup) {
        viewGroup = '.' + viewGroup
      }
      cdnDataManager.getComparableThings(function(things) {
        var a, newPath, newRun, rootPath, subIndex;
        // GOLD POSITION
        things.unshift(things.pop());
        if (things[index] && things[index].metrics) {
          rootPath = cdnDataManager.getComparisonPath().split('/').filter(function(p) {return !!p;})
          switch (cdnDataManager.getComparisonMethod()) {
            case cdnDataManager.COMPARE_RUNS:
              newRun = cdnDataManager.getRunIds();
              // GOLD POSITION
              newRun.unshift(newRun.pop());
              newRun = newRun[index];
              newPath = rootPath.slice();
              if (this.metricComparison.subpath) {newPath = newPath.concat(this.metricComparison.subpath.split('/'))}
              if (this.metricComparison.secondarySubpath) {newPath = newPath.concat(this.metricComparison.secondarySubpath.split('/'))}
              break;
            case cdnDataManager.COMPARE_TESTSUITES:
              newRun = things[index].id;
              newPath = rootPath.slice();
              if (this.metricComparison.secondarySubpath) {newPath = this.metricComparison.secondarySubpath.split('/')}
              break;
            case cdnDataManager.COMPARE_HISTORY:
              newRun = this.metricComparison.subpath;
              newPath = [];
              break;
          }
          newPath = newPath.filter(function(p) {return !!p;});
          newPath = newPath.join('/');
          if (things[index].metrics[rootPrefix+'.paths'+viewGroup]) {
            a = document.createElement('a');
            a.href = cdnPage.getUrlForNewHash(CDNHelpers.defaultObj({
              path: newPath,
              run: newRun,
              testsuite: undefined,
              history: undefined,
              run_header: undefined,
              timing_prefix: rootPrefix,
              timing_group: viewGroup
            }, ((this.pageConfig && this.pageConfig.navigation) || {})));
            a.textContent = value.renderedValue;
            CDNHelpers.removeChildren(valueCell);
            valueCell.appendChild(a);
          }
        }
      }.bind(this), this.metricComparison.subpath, this.metricComparison.secondarySubpath, this.metricComparison.forceSecondarySubpath);
    }

  window.CDNSlackCell = CDNSlackCell;

  window.CDNMetricComparison.registerCellRenderer('slack', CDNSlackCell);
})();

(function() {

  function CDNHistogramCell(metricComparison) {
    this.metricConfig = undefined;
    CDNCellRenderer.apply(this, arguments);
    this.className = 'cdn-histogram-cell';
    if (metricComparison) {
      this.popover = document.createElement('div');
      this.popover.className = 'cdn-histogram-popover';
      this.popoverText = document.createElement('div');
      this.popover.appendChild(this.popoverText);
    }
  }
  CDNHelpers.extend(CDNCellRenderer,CDNHistogramCell);

  CDNHistogramCell.no_wildcard_expansion = true;

  CDNHistogramCell.prototype.applyCells = function(cells, pageConfig) {
    var i, filteredAll, filteredRow, filteredConfigs, minComparison, maxComparison, regexp;

    this.pageConfig = pageConfig;
    this.cells = cells;

    if (this.className) {
      for (i = 0; i < this.cells.length; i++) {
        this.cells[i].className = this.className;
      }
    }
    for (i = 0; i < this.cells.length; i++) {
      if (i % 2 === 0) {
        this.cells[i].colSpan = 2;
      } else {
        // Don't need any delta cells
        this.cells[i].style.display = 'none';
      }
    }

    if (this.metricComparison instanceof CDNMetricSummaryComparison) {
      for (i = 0; i < this.cells.length; i += 2) {
        CDNHelpers.removeChildren(this.cells[i]);
      }
      return cells;
    }

    regexp = false;
    if (this.metricComparison.metric) {
      regexp = new RegExp(this.metricComparison.metric);
    }

    filteredAll = (this.groupAllComparisons || []).filter(function(c) {
      if (this.columnComparisons.indexOf(c) >= 0) {
        return false;
      }
      if (regexp !== false && ! c.metric.match(regexp)) {
        return false;
      }
      return true;
    }.bind(this));

    filteredConfigs = (this.groupPageConfigs.slice() || []);

    filteredRow = (this.groupRowComparisons || []).filter(function(c, i) {
      if (c === this.metricComparison) {
        filteredConfigs[i] = null;
        return false;
      }
      if (regexp !== false && ! c.metric.match(regexp)) {
        filteredConfigs[i] = null;
        return false;
      }
      return true;
    }.bind(this));

    filteredConfigs = filteredConfigs.filter(function(c){
      return c !== null;
    }.bind(this));

    if (pageConfig.no_shared_max) {
      minComparison = new CDNMetricSummaryComparison(CDNMetricSummaryComparison.MINIMUM, filteredRow.slice());
      maxComparison = new CDNMetricSummaryComparison(CDNMetricSummaryComparison.MAXIMUM, filteredRow.slice());
    } else {
      minComparison = new CDNMetricSummaryComparison(CDNMetricSummaryComparison.MINIMUM, filteredAll);
      maxComparison = new CDNMetricSummaryComparison(CDNMetricSummaryComparison.MAXIMUM, filteredAll);
    }

    filteredRow.unshift(maxComparison);
    filteredRow.unshift(minComparison);

    CDNHelpers.waitForAll(filteredRow, function(comparison, intermediateCallback) {
      comparison.getValueDescriptions(intermediateCallback);
    }, this.valuesUpdated.bind(this, filteredConfigs));

    return this.cells;
  };

  CDNHistogramCell.prototype.valuesUpdated = function(filteredConfigs, groupValues) {
    var comparison, i, j, waiting;

    comparison = [];

    this.minValue = groupValues.shift();
    this.maxValue = groupValues.shift();

    waiting = 0;

    waiting++;

    for (i = 0; i < groupValues.length; i++) {
      for (j = 0; j < groupValues[i].length; j++) {
        if (! comparison[j]) {
          comparison[j] = [];
        }
        comparison[j][i] = CDNHelpers.shallowClone(groupValues[i][j]);
        comparison[j][i].groupColumnName = '';
        if (filteredConfigs[i]) {
          if (filteredConfigs[i].title) {
            comparison[j][i].groupColumnName = filteredConfigs[i].title;
          } else if (filteredConfigs[i].metric) {
            waiting++;
            cdnDataManager.translateMetricName(filteredConfigs[i].metric, function(obj, name) {
              obj.groupColumnName = filteredConfigs[i].metric;
              waiting--;
              if (waiting === 0) {
                this.renderCellContents();
              }
            }.bind(this, comparison[j][i]));
          } else if (filteredConfigs[i].header) {
            comparison[j][i].groupColumnName = filteredConfigs[i].header;
          }

    if (waiting === 0) {
      this.renderCellContents();
    }
  };

  CDNHistogramCell.prototype.renderCellContents = function() {

    labels = cdnDataManager.getComparableLabels();

    labels.unshift(labels.pop());

  CDNHistogramCell.prototype.drawGraph = function(container, labels, minDesc, maxDesc, values, index) {

    function drawRect(color, fill, x0, y0, width, height) {
      var rect;

      rect = document.createElementNS(xmlns, 'rect');

      if (color) {
        rect.setAttributeNS(null, 'stroke-width', '1');
      }
      rect.setAttributeNS(null, 'x', x0);
      rect.setAttributeNS(null, 'y', y0);
      rect.setAttributeNS(null, 'width', width);
      rect.setAttributeNS(null, 'height', height);
      rect.setAttributeNS(null, 'fill', fill || 'none');

    gap = 4;

    min = minDesc.defined && minDesc.number ? minDesc.rawValue : 0;
    max = maxDesc.defined && maxDesc.number ? maxDesc.rawValue : 1;
    width = Math.max(0, (values.length * (bar + gap)) - gap);
    height = max - min;
    if (height === 0) {
      height = 1;
      if (min !== 0) {
        forceHeight = 1;
      }
    }

    xmlns = 'http://www.w3.org/2000/svg';
    svg = document.createElementNS(xmlns, 'svg');
    svg.setAttributeNS(null, 'viewBox', '0 ' + min + ' ' + width + ' ' + height);
    svg.setAttributeNS(null, 'version', '1.1');
    svg.setAttributeNS(null, 'preserveAspectRatio', 'none');
    svg.setAttributeNS(null, 'width', width + 'px');

    for (i = 0; i < values.length; i++) {

        title += values[i].renderedValue;
        rect.setAttributeNS(null, 'title', title);
        shade.setAttributeNS(null, 'title', title);

        rect.addEventListener('mouseover', this.setPopover.bind(this, shade));
        rect.addEventListener('mouseout', this.removePopover.bind(this, shade));
        shade.addEventListener('mouseover', this.setPopover.bind(this, shade));
        shade.addEventListener('mouseout', this.removePopover.bind(this, shade));
      }
    }

    CDNHelpers.removeChildren(container);
    container.appendChild(svg);
  };

  CDNHistogramCell.prototype.setPopover = function(el, event) {
    var clientRect, x, y;
    if (el && el.hasAttributeNS(null, 'title')) {
      clientRect = el.getBoundingClientRect();
      x = clientRect.left + (clientRect.width / 2);
      y = clientRect.top;
      this.popover.style.left = x + 'px';
      this.popover.style.top = y + 'px';

    };
  };

  CDNHistogramCell.prototype.removePopover = function(el, event) {
    if (el && el !== this.popoverElement) {
      return;
    }
    if (this.popover.parentNode) {
      this.popover.parentNode.removeChild(this.popover);
    }
  };


  window.CDNHistogramCell = CDNHistogramCell;
})();

(function() {

  function colorToRgba(definition) {
    if (!definition) {
      return undefined;
    }
    definition = '' + definition;
    if (definition.charAt(0) === '#') {
      definition = definition.match(/[0-9A-Fa-f]{2}/g);
      definition = definition.map(function(hex) {
        return parseInt(hex, 16);
      });
    } else {
      definition = definition.split(' ');
      definition = definition.map(function(val) {
        return +val;
      });
    }
    if (!definition.every(function(val) {
      return (val >= 0 && val < 256);
    })) {
      return undefined;
    }
    if (definition.length === 3) {
      return 'rgb('+definition.join(',')+')';
    } else if (definition.length === 4) {
      definition[3] = definition[3] / 255;
      return 'rgba('+definition.join(',')+')';
    } else {
      return undefined;
    }
  }

  function CDNHistogramRenderer(metricComparison) {
    CDNCellRenderer.apply(this, arguments);

    this.popover.className = 'cdn-histogram-popover';
    this.popoverText = document.createElement('div');
    this.popover.appendChild(this.popoverText);
  }
  CDNHelpers.extend(CDNCellRenderer,CDNHistogramRenderer);

  CDNHistogramRenderer.prototype.finalize = function() {

  CDNHistogramRenderer.prototype.renderCellContents = function() {

  CDNHistogramRenderer.prototype.computeHistogramData = function(values) {

        mergedSeries = seriesSequencer.mergeWith(CDNHelpers.keys(value.series));
        if (value.x_axis) {
          this.xAxisLabel = value.x_axis;

    data = {};
    for (i = 0; i < mergedLabels.length; i++) {
      data[mergedLabels[i]] = parsedValues.map(function(value, runIndex) {
        var data, index;
        data = {};
        if (value) {
          index = value.labels.indexOf(mergedLabels[i]);
          for (j = 0; j < mergedSeries.length; j++) {
            data[mergedSeries[j]] = undefined;
            if (index >= 0 && value.series[mergedSeries[j]]) {
              data[mergedSeries[j]] = {
                series: mergedSeries[j],
                label: mergedLabels[i],
                value: value.series[mergedSeries[j]].values[index]
              };
              if (parsedValues.length > 1) {
                data[mergedSeries[j]].compName = runIds[runIndex];

     * {
     *   "label1": [
     *     {
     *       "series1": {
     *         "compName": "T1",
     *         "series": "series1".
     *         "label": "label1",
     *         "value": 10.543
     *       },
     *       "series2": ...
     *     },
     *     ...
     *   ],
     *   "label2": ...
     * }
     *
     * labels are X-axis columns.
     * comparisons are directly inside labels
     * series are name of stack within column

    this.seriesVisibility = {};
    mergedSeries.map(function(term) {
      this.seriesVisibility[term] = true;
    }.bind(this));
    this.xLabels = mergedLabels;
    this.data = data;
    if (CDNHelpers.isEmpty(data)) {

  CDNHistogramRenderer.prototype.renderGraph = function() {
    var xmlns, svg, i, j, k, width, height, labels, series, comparisonCount, x, labelMax, graphMax, value, perLabelGap, perComparison, perComparisonGap, showLabelEvery, bar, yOffset, y0, y1;

    function drawRect(color, fill, x0, y0, x1, y1) {
      var rect;

      rect = document.createElementNS(xmlns, 'rect');
      rect.setAttributeNS(null, 'stroke', color || 'none');
      if (color) {
        rect.setAttributeNS(null, 'stroke-width', '2');

      rect.setAttributeNS(null, 'x', x0);
      rect.setAttributeNS(null, 'y', y0 + yOffset);
      rect.setAttributeNS(null, 'width', x1 - x0);
      rect.setAttributeNS(null, 'height', y1 - y0);

    }

    function drawPolygon(color, fill, x0, y0) {
      var polygon, points;

      points = Array.prototype.slice.call(arguments, 2).map(function(v, i) {
        if (i % 2 === 1) {
          return v + yOffset;
        } else {
          return v;
        }
      });

      polygon = document.createElementNS(xmlns, 'polygon');
      polygon.setAttributeNS(null, 'stroke', color || 'none');
      if (color) {
        polygon.setAttributeNS(null, 'stroke-width', '2');
      }
      polygon.setAttributeNS(null, 'points', points.join(' '));

      t.setAttributeNS(null, 'x', x);
      t.setAttributeNS(null, 'y', y + yOffset);
      if (r) {
        t.setAttributeNS(null, 'transform', 'rotate('+r+' '+x+','+(y + yOffset - 2)+')');

      t.textContent = text;

    function valueFromY(y) {

    perComparison = 8; // Bar width
    perComparisonGap = 1;
    perLabelGap = 4;

    showLabelEvery = this.pageConfig.show_label_every === undefined ? 2 : Math.max(this.pageConfig.show_label_every, 1);

    labels = this.xLabels;
    series = CDNHelpers.keys(this.seriesVisibility);
    comparisonCount = cdnDataManager.getComparisonCount();

    height = 160;

    xmlns = 'http://www.w3.org/2000/svg';
    svg = document.createElementNS(xmlns, 'svg');
    svg.setAttributeNS(null, 'viewBox', '0 0 ' + width + ' ' + (height + yOffset));
    svg.setAttributeNS(null, 'version', '1.1');
    svg.setAttributeNS(null, 'preserveAspectRatio', 'xMaxYMid meet');
    svg.setAttributeNS(null, 'width', width);
    svg.setAttributeNS(null, 'height', (height + yOffset));

    // Draw axis
    drawPolygon('#000', undefined, 49, 0, 49, height - 50);
    //drawPolygon('#000', undefined, 49, 210, width - 100, 210);

    graphMax = 0;
    // draw labels
    for (i = 0; i < labels.length; i++) {
      x = 50 + ((perLabelGap + (comparisonCount * perComparison) + ((comparisonCount - 1) * perComparisonGap)) * (i + 0.5));
      if (i % showLabelEvery === 0) {
        drawPolygon('#888', undefined, x, height - 47, x, height - 50);
        drawText('#000', labels[i], true, x, height - 40, (comparisonCount <= 1 && showLabelEvery <= 1) ? 300 : 330).setAttributeNS(null, 'class', 'pie-slice-label');
      }
      // Calculate the max Y value to set our scale
      labelMax = this.data[labels[i]].reduce(function(previous, comparison) {
        var i, total;
        total = 0;
        for (i = 0; i < series.length; i++) {
          if (comparison && comparison[series[i]] && comparison[series[i]].value !== undefined) {
            total += comparison[series[i]].value;
          }
        }
        return Math.max(previous, total);
      }, 0);
      if (labelMax > graphMax) {
        graphMax = labelMax;
      }
    }

    // Draw Y axis
    drawPolygon('#000', undefined, 45, 1, 50, 1);
    drawPolygon('#000', undefined, 45, height - 50, 50, height - 50);
    drawText('#000', graphMax, true, 41, 7).setAttributeNS(null, 'class', 'pie-slice-label');
    drawText('#000', '0', true, 41, height - 50).setAttributeNS(null, 'class', 'pie-slice-label');

    // draw series
    for (i = 0; i < labels.length; i++) {
      x = 50 + ((perLabelGap + (comparisonCount * perComparison) + ((comparisonCount - 1) * perComparisonGap)) * i) + (perLabelGap/2);
      for (j = 0; j < comparisonCount; j++) {
        labelMax = 0;
        for (k = 0; k < series.length; k++) {
          value = this.data[labels[i]][j][series[k]];
          if (value && value.value > 0) {
            y0 = scaleY(labelMax + value.value);
            y1 = scaleY(labelMax);
            if (y1 - y0 < 3) {
              y0 = y1 - 3;
              labelMax += valueFromY(y0) - valueFromY(y1);
            } else {
              labelMax += value.value;
            }
            bar = drawRect(undefined, CDNColor.get(k), x, y0, x + perComparison, y1);
            bar.setAttributeNS(null, 'title', value.value+"\n"+value.series+"\n"+(value.compName ? value.compName + "\n" : '')+value.label);
            bar.addEventListener('mouseover', this.setPopover.bind(this));
            bar.addEventListener('mouseout', this.removePopover.bind(this));

    labelMax = 20;
    for (i = series.length - 1; i >= 0; i--) {

      drawText('#000', series[i], false, x + 15, labelMax + 8).setAttributeNS(null, 'class', 'pie-slice-label');
      labelMax += 12;
    }

    // axis labels
    if (this.xAxisLabel) {
      drawText('#000', this.xAxisLabel, true, width - 115, height - 5);
    }
    if (this.yAxisLabel) {
      drawText('#000', this.yAxisLabel, true, 10, 5, 270);
    }

    CDNHelpers.removeChildren(this.cells[0]);
    this.cells[0].appendChild(svg);
  };

  CDNHistogramRenderer.prototype.parseHistogramData = function(description) {
    var value, name;

    if (! description.defined) {
      return undefined;
    }

    value = CDNHelpers.parseTclDict(description.rawValue);
    if (! value || CDNHelpers.isEmpty(value)) {
      return undefined;
    }
    if (value.labels) {
      value.labels = CDNHelpers.parseTclList(value.labels);
    } else {
      value.labels = [];
    }
    if (value.series) {
      value.series = CDNHelpers.parseTclDict(value.series);
    } else {
      value.series = {};
    }

    for (name in value.series) {
      if (value.series[name]) {
        value.series[name] = CDNHelpers.parseTclDict(value.series[name]);
        if (value.series[name] && ! CDNHelpers.isEmpty(value.series[name])) {
          // TODO: parse color values
          if (value.series[name].values) {
            value.series[name].values = CDNHelpers.parseTclList(value.series[name].values).map(function(n){return parseFloat(n, 10);});
          } else {
            value.series[name].values = [];
          }
        } else {
          value.series[name] = undefined;
        }
      } else {
        value.series[name] = undefined;
      }
    }
    return value;
  };

  CDNHistogramRenderer.prototype.setPopover = function(event) {
    var clientRect, x, y;
    if (event.target) {
      clientRect = event.target.getBoundingClientRect();
      x = clientRect.left + (clientRect.width / 2);
      y = clientRect.top;
      this.popover.style.left = x + 'px';
      this.popover.style.top = y + 'px';
      this.popoverText.textContent = event.target.getAttributeNS(null, 'title');
      this.popoverElement = event.target;
      window.document.body.appendChild(this.popover);
    };
  };

  CDNHistogramRenderer.prototype.removePopover = function(event) {
    if (event && event.target && event.target !== this.popoverElement) {
      return;
    }
    if (this.popover.parentNode) {
      this.popover.parentNode.removeChild(this.popover);
    }
  };

  window.CDNHistogramRenderer = CDNHistogramRenderer;

  window.CDNMetricComparison.registerCellRenderer('histogram', CDNHistogramRenderer);
})();
</script>

// Top-level function so we can have a per-file var scope
(function() {

  function CDNWinsLossesCell(metricComparison) {
    CDNCellRenderer.apply(this, arguments);
    this.className = 'cdn-wl-cell';
  }
  CDNHelpers.extend(CDNCellRenderer,CDNWinsLossesCell);

  CDNWinsLossesCell.prototype.renderCellContents = function() {
    var i, showPercent, valueCell, deltaCell, method;

    for (i = 0; i < this.values.length; i++) {
      valueCell = this.cells[i * 2];
      deltaCell = this.cells[(i * 2) + 1];
      if (! valueCell) { continue; }
      this.fillValueCell(valueCell, i, this.values[i]);
      deltaCell.style.display = 'none';
      valueCell.removeAttribute('data-has-delta-cell');
      valueCell.colSpan = 2;
      valueCell.title = '';
      deltaCell.title = '';
      if (! this.values[i].singleMetric && this.values[i].gold) {
        valueCell.setAttribute('data-metric-compare', 'gold');
        deltaCell.setAttribute('data-metric-compare', 'gold');
      } else {
        valueCell.removeAttribute('data-metric-compare');
        deltaCell.removeAttribute('data-metric-compare');
      }
      valueCell.setAttribute('data-metric', this.values[i].name);
      valueCell.setAttribute('data-metric-type', 'WinsLosses');
    }
  };

  CDNWinsLossesCell.prototype.fillValueCell = function(valueCell, index, value) {
    var bg, fg;

    function el(type, childOf, className, textContent) {
      var el = document.createElement(type);
      if (className !== undefined) {
        el.className = className;
      }
      if (textContent !== undefined) {
        el.textContent = textContent;
      }
      if (childOf !== undefined) {
        childOf.appendChild(el);
      }
      return el;
    }

    CDNHelpers.removeChildren(valueCell);
    if (! value.singleMetric && value.gold) {
      return;
    }
    if (CDNHelpers.isEmpty(value.rawValue) || !(value.rawValue.total > 1)) {
      return;
    }
    bg = el('div', valueCell, 'cdn-wl-cell-bg');
    if (value.rawValue.winsIncludeThreshold) {
      el('div', bg, 'cdn-wl-cell-bg-good').style.width = ((value.rawValue.wins - value.rawValue.thresholdWins) * 100 / value.rawValue.total) + '%';
      el('div', bg, 'cdn-wl-cell-bg-good-threshold').style.width = (value.rawValue.thresholdWins * 100 / value.rawValue.total) + '%';
    } else {
      el('div', bg, 'cdn-wl-cell-bg-good').style.width = (value.rawValue.wins * 100 / value.rawValue.total) + '%';
    }
    el('div', bg, 'cdn-wl-cell-bg-same').style.width = (value.rawValue.same * 100 / value.rawValue.total) + '%';
    el('div', bg, 'cdn-wl-cell-bg-undef').style.width = (100 - (value.rawValue.defined * 100 / value.rawValue.total)) + '%';
    if (value.rawValue.winsIncludeThreshold) {
      el('div', bg, 'cdn-wl-cell-bg-bad-threshold').style.width = (value.rawValue.thresholdLosses * 100 / value.rawValue.total) + '%';
      el('div', bg, 'cdn-wl-cell-bg-bad').style.width = ((value.rawValue.losses - value.rawValue.thresholdLosses) * 100 / value.rawValue.total) + '%';
    } else {
      el('div', bg, 'cdn-wl-cell-bg-bad').style.width = (value.rawValue.losses * 100 / value.rawValue.total) + '%';
    }
    fg = el('div', valueCell, 'cdn-wl-cell-fg');
    el('span', fg, 'cdn-wl-cell-fg-good', value.rawValue.wins);
    el('span', fg, 'cdn-wl-cell-fg-separator', '/');

  };

  window.CDNWinsLossesCell = CDNWinsLossesCell;

})();

}

  padding: 0;
  list-style-type: none;
}

}

}

.cdn-histogram-popover, .cdn-datacell-popover {
  position: fixed;
  top: 0;
  left: 0;
  z-index: 1000;
}

.cdn-histogram-popover > div, .cdn-datacell-popover > div {
  background-color: #112;
  color: #eee;
  position: absolute;
  overflow: hidden;
  height: auto;
  bottom: 9px;
  left: -50px;
  width: 100px;
  min-width: 100px;
  border: 1px solid white;
  padding: 5px;
  font-size: 12px;
  white-space: pre-line;
}
.cdn-datacell-popover > div {
  left: -30px;
}
.cdn-datacell-popover.below > div {
  top: 9px;
  bottom: auto;
}
.cdn-datacell-popover.right > div {
  left: auto;
  right: -30px;
}

.cdn-datacell-popover > div {
  width: auto;
}

.cdn-datacell-popover table {
  border-style: none;
}

.cdn-datacell-popover tr, .cdn-datacell-popover th, .cdn-datacell-popover td {
  background-color: transparent;
  border-style: none;
  text-align: left;
}
.cdn-datacell-popover td::before {
  content: ':';
  font-weight: bold;
  margin-right: 0.4em;
}
.cdn-datacell-popover-target-bad {
  margin-left: 0.5em;
  text-transform: uppercase;
  color: rgb(255, 53, 53);
  font-weight: bold;
}
.cdn-datacell-popover-target-warning {
  margin-left: 0.5em;
  text-transform: uppercase;
  color: rgb(255, 255, 102);
  font-weight: bold;
}
.cdn-datacell-popover-target-good {
  margin-left: 0.5em;
  text-transform: uppercase;
  color: rgb(40, 255, 26);
  font-weight: bold;
}
.cdn-datacell-popover-target-bad_threshold {
  margin-left: 0.5em;
  text-transform: uppercase;
  color: rgb(255, 53, 53);
  font-weight: bold;
}
.cdn-datacell-popover-target-good_threshold {
  margin-left: 0.5em;
  text-transform: uppercase;
  color: rgb(40, 255, 26);
  font-weight: bold;
}

.cdn-histogram-popover::before, .cdn-datacell-popover::before {
  position: absolute;
  bottom: 0;
  left: 50%;
  margin-left: -7px;
  width: 0;
  height: 0;
  border-color: white transparent transparent transparent;
  border-width: 10px 7px 0 7px;
  border-style: solid;
  content: '';
}
.cdn-datacell-popover.below::before {
  top: 0;
  bottom: auto;
  border-color: transparent transparent white transparent;
  border-width: 0 7px 10px 7px;
}

.cdn-histogram-popover::after, .cdn-datacell-popover::after {
  position: absolute;
  bottom: 2px;
  left: 50%;
  margin-left: -5px;
  width: 0;
  height: 0;
  border-color: #311 transparent transparent transparent;
  border-width: 8px 5px 0 5px;
  border-style: solid;
  content: '';
}
.cdn-datacell-popover.below::after {
  top: 2px;
  bottom: auto;
  border-color: transparent transparent #311 transparent;
  border-width: 0 5px 8px 5px;
}

  {"metric":"flow.machine.hostname","tcl":"\n  set_metric -name flow.machine.os -value \"$::tcl_platform(os) $::tcl_platform(osVersion)\"\n  if {$::tcl_platform(os) != \"Linux\"} {return [info hostname]}\n  if {[file isfile \/proc\/cpuinfo]} { \n    set if [open \"\/proc\/cpuinfo\" r]\n    set cpus 0\n    while {![eof $if]} {\n      gets $if line\n      set metric [string trim [lindex [split $line :] 0]]\n      set full_value [lindex [split $line :] 1]\n      set value [lindex [string trim [lindex [split $line \":\"] 1]] 0]\n      set unit [lindex [string trim [lindex [split $line \":\"] 1]] 1]\n      switch -- \"$metric\" {\n        \"cpu MHz\"    { set_metric -name flow.machine.cpu.frequency -value \"$value Mhz\" }\n        \"cpu GHz\"    { set_metric -name flow.machine.cpu.frequency -value \"$value Ghz\" }\n        \"model name\" { set_metric -name flow.machine.cpu.model -value \"$full_value\" }\n      }\n      if {$metric == \"processor\"} {incr cpus}\n    }\n    close $if\n    set_metric -name flow.machine.cpu.number -value $cpus\n  }\n  set mem_id [open \"\/proc\/meminfo\" r]\n  while {![eof $mem_id]} {\n    gets $mem_id line\n    set metric [string trim [lindex [split $line :] 0]]\n    set value [lindex [string trim [lindex [split $line \":\"] 1]] 0]\n    set unit [lindex [string trim [lindex [split $line \":\"] 1]] 1]\n    switch -- \"$metric\" {\n      MemTotal  { set_metric -name flow.machine.memory.total -value \"$value $unit\" }\n      MemFree   { set_metric -name flow.machine.memory.free -value \"$value $unit\" }\n      SwapTotal { set_metric -name flow.machine.swap.total -value \"$value $unit\" }\n      SwapFree  { set_metric -name flow.machine.swap.free -value \"$value $unit\" }\n    }\n  }\n  close $mem_id\n  return [info hostname]\n","description":"Set the hostname and capture other machine related metrics","dp":"0","tcl_interp":"legacy"},

  {"metric":"flow.memory","units":"MB","type":"memory","description":"Current memory footprint","dp":"0","cmp":"lessBetter","inheritance_tcl":"\n  set log_values {}\n  if {![::um::userscript::is_common_ui_mode_available]} {\n    foreach command \"get_metric um::get_metric\" { dict set log_values $command [isLogCommand $command]}\n    foreach {c v} $log_values { if {$v} {unlogCommand $c}}\n  }\n  set m [lindex [get_metric -id $db_id -uuid $self_uuid $metric.instant] 1]\n  # Use get_metric to normalize to MB and strip off units\n  foreach cu $children_uuid {set child [lindex [get_metric -id $db_id -uuid $cu $metric] 1]; if {$child > $m || $m == \"\"} {set m $child}}\n  if {![::um::userscript::is_common_ui_mode_available]} {\n    foreach {c v} $log_values { if {$v} {logCommand $c}}\n  }\n  if {$m == \"\"} {return \"\"}\n  return [list $m MB]\n","inherit_no_children":true,"tcl_interp":"legacy"},

  {"metric":"flow.memory.resident.peak","units":"MB","type":"memory","description":"Maximum resident memory footprint","dp":"0","cmp":"lessBetter","inheritance_tcl":"\n  set log_values {}\n  if {![::um::userscript::is_common_ui_mode_available]} {\n    foreach command \"get_metric um::get_metric\" { dict set log_values $command [isLogCommand $command]}\n    foreach {c v} $log_values { if {$v} {unlogCommand $c}}\n  }\n  set m [lindex [get_metric -id $db_id -uuid $self_uuid $metric.instant] 1]\n  # Use get_metric to normalize to MB and strip off units\n  foreach cu $children_uuid {set child [lindex [get_metric -id $db_id -uuid $cu $metric] 1]; if {$child > $m || $m == \"\"} {set m $child}}\n  if {![::um::userscript::is_common_ui_mode_available]} {\n    foreach {c v} $log_values { if {$v} {logCommand $c}}\n  }\n  if {$m == \"\"} {return \"\"}\n  return [list $m MB]\n","inherit_no_children":true,"tcl_interp":"legacy"},

  {"metric":"flow.tool_list","description":"List of tools used in flow","dp":"0","inheritance_tcl":"\n  set log_values {}\n  if {![::um::userscript::is_common_ui_mode_available]} {\n    foreach command \"get_metric um::get_metric\" { dict set log_values $command [isLogCommand $command]}\n    foreach {c v} $log_values { if {$v} {unlogCommand $c}}\n  }\n  set tool_list [list \"[lindex [get_metric -id $db_id -uuid $self_uuid flow.tool.name.short] 1]-[lindex [get_metric -id $db_id -uuid $self_uuid flow.tool.version] 1]\"]\n  if {![::um::userscript::is_common_ui_mode_available]} {\n    foreach {c v} $log_values { if {$v} {logCommand $c}}\n  }\n  if {$tool_list eq \"-\"} {set tool_list \"\"}\n  foreach c $children {set tool_list [concat $tool_list $c]}\n  return [lsort -unique $tool_list]\n","inherit_no_children":true,"tcl_interp":"legacy"},

  {"metric":"messages","tcl":"\n  set log_values {}\n  set my_eval eval\n  if {[info commands eval_legacy] ne \"\"} { set my_eval eval_legacy; }\n  # check that the procs exist\n  if {[$my_eval \"namespace eval ::flowkit {info commands generic.get_msg_since_last_call}\"] eq {}} {\n    return {}\n  } else {\n    if {![::um::userscript::is_common_ui_mode_available]} {\n      foreach command \"get_message report_message help\" { dict set log_values $command [isLogCommand $command]}\n      foreach {c v} $log_values { if {$v} {unlogCommand $c}}\n    }\n    # call the flowkit messages with out own var\n    set return [$my_eval \"::flowkit::generic.get_msg_since_last_call ::um::userscript::metric_last_message\"]\n    if {![::um::userscript::is_common_ui_mode_available]} {foreach {c v} $log_values { if {$v} {logCommand $c}}}\n    return $return\n  }\n","type":"messages","description":"messages","dp":"0","inheritance_tcl":"\n  # add the counts together of the similar messages\n  # format is: [list {count 1 id IMPDBTCL-247 ... }]\n  set parent_dict {}\n  foreach c $children {\n    foreach e $c {\n      if {$e ne {}} {\n        if {[dict exists $parent_dict [dict get $e \"id\"]]} {\n          dict set parent_dict [dict get $e \"id\"] \"count\"  [expr [dict get $parent_dict [dict get $e \"id\"] \"count\"]  + [dict get $e \"count\"]]\n        } else {\n          dict set parent_dict [dict get $e \"id\"] $e\n        }\n      }\n    }\n  }\n  return [dict values $parent_dict]\n","tcl_interp":"legacy"},
